INSERT INTO `oprst_jot_content` VALUES ('181','Выпуск 15 -- поцы!','','1','361','169','','5.105.10.224','b573ea05793f4f308f3d6fa8ad74d818','Ты че поц чтоле?Зависть берет?А то что у остальных факультетов шутки из КВН 95 года, это они типо молодцы??Да??А металлурги  сами все ставили!И именно поэтому им отдельный РЕСПЕКТ!!!!!\nТак что сиди и завидуй им!\nТы сам то пробовал хоть ОДИН танец поставить?Я уже молчу про весь концерт.\nА шутки из КВН брать это много ума не нужно!\nМеталлурги вам покажут кто тут who is who!','0','0','1431625485','0','0','0','0','0','1431629506','1','-24');
