INSERT INTO `oprst_jot_content` VALUES ('190','угомонись.','','1','361','181','','217.67.66.191','86f3aa62cb3135ba88d3fc81cebff21e','Если бы жюри не сказал про то что шутки были из КВН 96 года, ты бы до сих пор не знал бы об этом. Там в зале 95% присутствующих вообще не отбивали то что эта сценка из КВН 95 года. И при чем тут \"ума не надо\", не вижу ничего плохого в том что ребята подняли или оживили эту шутку, и тем более весь зал смеялся и всем было смешно, никому не было дела до того откуда они её взяли, с какого она КВН и т.д и т.п','0','0','1431631335','0','0','0','0','0','1431631387','1','-28');
