INSERT INTO `oprst_jot_content` VALUES ('195','Самая кортавая студвесна...','','1','361','0','','31.202.211.79','f5c3f64525902dcdf3aff601276cc4c0','Многое изменилось в универе за эти шесть лет\nИзменились фавориты и лидеры\nНе меняется лишь одно: ФАКУЛЬТЕТ \"ПОЙМАВШИЙ ЗВЕЗДУ\" тут же , стремительно опускается на последние позиции рейтинга университетских фестивалей.\nВот экономисты, много лет подряд позиционируют себя , как ох...х , МЕГАталантливых, и с гордо поднятой (задранной) головой летят вниз с Олимпа славы Студ.весны.\nПоправочка, уже упали.\nМеталлурги за последние годы просто за.....ли своими лагерными приколами. Мы не дебилы, и это не интернат, а университет. Оставьте сценки для лагеря на лето.\nЯ прям удивилась, почему у сварщиков и гуманитариев никто за эти два дня не родился???? А как же \" Есть повод\"? Повод вынести торт на сцену\nВторой день феста- отдельная тема\nЭто был САМЫЙ КОРТАВЫЙ конкурсный день.\nЭнергетики- если бы я не посмотрела \"труп невесты\" , предварительно, я бы ничего на поняла.\nОднако это ничто, по сравнению со сваркой. О\'Генри перевернулся 23 раза в гробу, потому как вы мастерски сыграли его рассказ про рождественские подарки задом на перед. Кто в зале догадался , ЧТО именно девушка подарила своему Джиму, Вам респект. (Подсказка: это был ремешок на часы(по рассказу))\nТем кто дочитал коммент до конца, желаю ярких творческих находок))) и достойной их реализации.\nИ ПУСТЬ ПОБЕДИТ СИЛЬНЕЙШИЙ!!!\n','0','0','1431643457','0','0','0','0','0','1431643591','1','-3');
