INSERT INTO `oprst_jot_content` VALUES ('425','','','1','408','0','','46.160.99.65','a78db5f4a126bf6eee9c6f22573d338b','Украина!!! Ну конечно! ))\nКак любить по телевизору Мариуполь и кричать, что Мариуполь - мы с вами. Это они могут. И на словах все поддерживают и любят. Но как до дела, на праздник, в который бы логично было бы поддержать фронтовой город... неее\nНикто не приехал, ни правительство, ни звёзды. Никому мы нафиг не нужны, вот так. \n','0','0','1440675479','0','0','0','0','0','1440675557','1','0');
INSERT INTO `oprst_jot_content` VALUES ('428','Русский язык нужно знать!','','1','408','0','','5.105.138.153','2496d4711ddf78c4bd0556b569d566cf','Согласно правилам русского языка следует говорить только \"на Украине\" - суверенность другого государства не может влиять на грамматику какого-либо языка. Если люди пользуются русским языком, они должны строить фразы по правилам русского языка без поправок на национальное самосознание. Не надо путать язык с политикой. Иначе «в Украине» будет восприниматься как встречное посягательство на русский язык — государственный язык Российской Федерации и национальное достояние.','0','0','1440701551','0','0','0','0','0','1440709294','1','-4');
