INSERT INTO `oprst_jot_content` VALUES ('432','','','1','410','0','','46.160.99.65','f5ba805db7679bbe18caf0c0e1a6e601','Чтооооо? Простие.... Что за специальность компьютерные науки?\nКем они выйдут? Это тоже самое, что \"работник работы\" )) Образование айтишное подразумевает массу специальностей, как это практикуется в нормальных ВУЗах: от Веб-разработчика до Дизайнера.\nПредполагаю, что с тем оборудованием, что стоит в ПГТУ, только и остается, как изучать эти \"компьютерные науки\". Профессии обучиться там точно не получится. Мда... Обидно за первокурсников.\nПГТУ сдает позиции. \nЖдем специальностей: Алхимические науки, Мастер профессии, Заводской теоретик и т.д.','0','0','1441133828','0','0','0','0','0','1441133871','1','3');
