INSERT INTO `oprst_site_content` VALUES ('1','document','text/html','Очень главная','','','index','','1','0','0','0','0','','<p>В далёкие и древние времена, когда люди поклонялись Солнцу, а женщины не брили ноги - пророк Моисей предсказал, что - в 2015 году произойдёт ПРОРЫВ в интернет-пространстве, и человечество увидит второе пришествие сайта &laquo;ОПРСТ&raquo;. И если Вы сейчас читаете это и улыбаетесь, то Библейские пророчества сбываются прямо сейчас и Моисей не фуфлогон!</p>\n<p>Нам часто задают вопрос: &laquo;Чё за тупое название?&raquo; Так вот, отвечаем: &laquo;ОПРСТ&raquo; с китайского означает &laquo;сосуд, полный счастья&raquo;. Действительно, так и есть! Спросите у китайцев.<br>А по сути - это первый масштабный интернет видео-канал, в котором идеально гармонируют юмор и название вулкана Эйяфьядлайёкюдль, позитив и серые будни! Только у нас Вы сможете увидеть свежие новости через год!</p>\n<p>Мы постоянно развиваемся и не стоим на месте. И поэтому с радостью прислушаемся к вашим идеям и советам! Пишите, стучите, звоните, и мы осветим любое событие города, даже если это будет \"Битва полов 2\"!<br>И ещё... Не пугайтесь наших журналистов, если они к Вам пристали - значит, Вы им понравились!</p>\n<p>Хорошего вам настроения, предохраняйтесь и не кашляйте!</p>','1','3','0','1','1','1','1130304721','1','1428043527','0','0','0','1130304721','1','','0','0','0','0','0','0','0','1');
