INSERT INTO `oprst_site_content` VALUES ('6','document','text/html','Video-бурса','','','video-bursa','','1','0','0','5','0','Интернет-канал ОПРСТ','<p>Хочешь научиться снимать первоклассное видео &ndash; тогда тебе &nbsp;к нам.&nbsp;Лучшая видеошкола города открывает набор.</p>\n<p>Получи профессиональные навыки видеосъемки и монтажа, научись правильной обработке звукозаписи&nbsp;и мастерингу, освой постпродакшн и работу с эффектами, а также обучись&nbsp;приемам креативного мышления&nbsp;и работе в кадре.</p>\n<p>Получи уникальную возможность стать видео-, звуко-оператором, монтажером,&nbsp;режиссером на базе самого&nbsp;популярного интернет-канал города по акционной цене.</p>\n<p>&nbsp;<img src=\"assets/images/forms/videoshkola.jpg\" width=\"979\" height=\"145\"></p>','1','26','0','1','1','1','1426334168','3','1438804399','0','0','0','1426334168','1','','0','0','0','0','0','0','0','1');
