INSERT INTO `oprst_site_content` VALUES ('8','document','text/html','Пригласить нас','','','priglasit-nas','','1','0','0','5','0','','<div class=\"center content home\" style=\"margin-top: 4px;\">\n<div class=\"row clearfix\">\n<div class=\"bigtitle\"><span>Пригласить</span><br><span style=\"margin-left: 115px; margin-top: -35px;\">нас</span></div>\n</div>\n<div class=\"row clearfix\">\n<p class=\"article_video\">Все знают, что если ОПРСТ присутствует на мероприятии, то оно автоматически становится праздником! Ведь всегда приятно работать с профессионалами и фанатами своего дела.<br>Команда ОПРСТ - это профессиональные операторы, фотографы и ведущие.<br>Мы выбираем самые крутые события, а наши видео заставляют кусать локти всех тех, кто пропустил Ваш праздник. <strong>Если Вы считаете, что Ваше мероприятие достойно внимания и Вы создали достойный инфоповод, &nbsp;мы, однозначно едем к Вам!</strong><br><br>Заполняйте форму приглашения и мы ответим вам.</p>\n<button class=\"bouttonYellow\" id=\"openButton\">Отправить заявку</button></div>\n<div class=\"row inputForm\">\n<script type=\"text/javascript\">// <![CDATA[\nvar submitted=false;\n// ]]></script>\n<iframe id=\"hidden_iframe\" name=\"hidden_iframe\" width=\"320\" height=\"240\" style=\"display: none;\" onload=\"if(submitted) {window.location=\'http://oprst.com.ua/spasibo\';}\"></iframe><form id=\"slideForm\" action=\"https://docs.google.com/forms/d/1MlrOUwbHrXVgH0wIWsYuPM5xSdhekKFV7rTVN5bJPyk/formResponse\" method=\"POST\" target=\"hidden_iframe\" onsubmit=\"submitted=true;\">\n<div>\n<h3>Пригласить нас</h3>\n<div class=\"rowForm\"><span class=\"inputLabel\">ФИО<span class=\"redStar\">*</span></span> <input type=\"text\" placeholder=\"Полностью как в паспорте\" name=\"entry.374726617\" value=\"\" class=\"ss-q-short\" id=\"entry_374726617\" dir=\"auto\" aria-label=\"ФИО Полностью как на паспорте \" aria-required=\"true\" required=\"\" title=\"\"> <span class=\"inputLabel\">Номер телефона<span class=\"redStar\">*</span></span> <input type=\"text\" name=\"entry.1692470219\" required=\"\"> <span class=\"inputLabel\">Электронная почта<span class=\"redStar\">*</span></span> <input type=\"email\" name=\"entry.379713674\" required=\"\">\n<div class=\"error-message\" id=\"417724324_errorMessage\">Укажите действительный адрес эл. почты</div>\n</div>\n<div class=\"rowForm\"><span class=\"inputLabel\">Какой специалист вам нужен</span> <label> <input type=\"checkbox\" name=\"&lt;entry.1039007411\" value=\"Работа в кадре (Ведущий)\" id=\"group_1039007411_1\" role=\"checkbox\" class=\"ss-q-checkbox valid\"> <span class=\"ss-choice-label\"></span> <span class=\"ss-choice-label\">Работа в кадре (Ведущий)</span> </label> <label> <input type=\"checkbox\" name=\"entry.1039007411\" value=\"Видеосъёмка\" id=\"group_1039007411_2\" role=\"checkbox\" class=\"ss-q-checkbox\"> <span class=\"ss-choice-label\"></span> <span class=\"ss-choice-label\">Видеосъёмка</span> </label> <label> <input type=\"checkbox\" name=\"entry.1039007411\" value=\"Фотосъёмка\" id=\"group_1039007411_3\" role=\"checkbox\" class=\"ss-q-checkbox\"> <span class=\"ss-choice-label\"></span> <span class=\"ss-choice-label\">Фотосъёмка</span> </label> <label> <input type=\"checkbox\" name=\"entry.1039007411\" value=\"Видеомонтаж\" id=\"group_1039007411_4\" role=\"checkbox\" class=\"ss-q-checkbox\"> <span class=\"ss-choice-label\"></span> <span class=\"ss-choice-label\">Видеомонтаж</span> </label> <label> <input type=\"checkbox\" name=\"entry.1039007411\" value=\"Фотомонтаж\" id=\"group_1039007411_5\" role=\"checkbox\" class=\"ss-q-checkbox\"> <span class=\"ss-choice-label\"></span> <span class=\"ss-choice-label\">Фотомонтаж</span> </label>\n<div class=\"ss-choice-item\"><label><label> <input type=\"checkbox\" name=\"entry.1039007411\" value=\"__other_option__\" id=\"group_1039007411_6\" role=\"checkbox\" class=\"ss-q-checkbox ss-q-other-toggle\"></label></label>\n<p class=\"ss-choice-label\">Другое:</p>\n<span class=\"ss-q-other-container goog-inline-block\"><input type=\"text\" name=\"entry.1039007411.other_option_response\" value=\"\" class=\"ss-q-other\" id=\"entry_1039007411_other_option_response\" dir=\"auto\" aria-label=\"Другое\"></span></div>\n</div>\n<div class=\"rowForm\">\n<div class=\"textArea\">\n<div class=\"ss-q-title\" style=\"font-size: 18px;\">Мероприятие</div>\n<textarea name=\"entry.235806981\" rows=\"8\" cols=\"0\" class=\"ss-q-long\" id=\"entry_235806981\" dir=\"auto\" required=\"\" placeholder=\"Свадьба, выпускной, корпоратив и т.д \"></textarea></div>\n<div class=\"dateForm\">\n<div class=\"ss-q-title\">Дата мероприятия</div>\n<input type=\"date\" name=\"entry.1949057553\" value=\"\" class=\"ss-q-date\" dir=\"auto\" id=\"entry_1949057553\" aria-label=\"Дата мероприятия  \">\n<div style=\"float: right;\"></div>\n</div>\n<div class=\"timeForm\">\n<div class=\"ss-q-title\" style=\"margin-bottom: 14px;\">Время мероприятия</div>\n<div class=\"ss-q-help ss-secondary-text\" dir=\"ltr\">с</div>\n<input type=\"time\" name=\"entry.1644595559\" value=\"00:00\" class=\"ss-q-time\" dir=\"auto\" id=\"entry_1644595559\" aria-label=\"Время мероприятия с \">\n<div class=\"ss-q-title\"></div>\n<div class=\"ss-q-help ss-secondary-text\" dir=\"ltr\">до</div>\n<input type=\"time\" name=\"entry.692145203\" value=\"00:00\" class=\"ss-q-time\" id=\"entry_692145203\" aria-label=\" до \"></div>\n</div>\n</div>\n<input type=\"submit\" name=\"submit\" id=\"ss-submit\" class=\"bouttonYellow\" style=\"margin: 12px auto -30px;\" value=\"Отправить\"></form></div>\n<div class=\"row\">[!Ditto? &amp;tpl=`citate.item` &amp;parents=`322` &amp;display=`1` &amp;randomize=`1` &amp;sortBy=`menuindex` &amp;sortDir=`ASC` &amp;noResults=``!]\n<div class=\"imageCollection\"><img src=\"assets/images/forms/priglasit-ans.jpg\" height=\"145\" width=\"1004\" style=\"margin-left: 10px;\"></div>\n<p class=\"article_video\">Если же Вы хотите со 100% уверенностью получить группу профессионалов на свое мероприятие, либо заказать индивидуальный спектр услуг от команды ОПРСТ, тогда вы правильно обратились!</p>\n<div class=\"bouttonYellow\">Коммерческое предложение</div>\n<div class=\"partners\">\n<h3>Наши постоянные партнёры</h3>\n<div><a href=\"our_project.html\"><img src=\"assets/images/partner_step.png\" height=\"60\" width=\"62\" alt=\"КА ШАГ\"></a> <a href=\"our_project.html\"><img src=\"assets/images/partner_videoschool.png\" height=\"44\" width=\"125\" alt=\"Video School\" style=\"margin-bottom: 7px; margin-left: 35px;\"></a> <a href=\"our_project.html\"><img src=\"assets/images/partner_0629.jpg\" height=\"60\" width=\"62\" alt=\"Video School\" style=\"margin-bottom: 7px; margin-left: 35px;\"></a> <a href=\"our_project.html\"><img src=\"assets/images/partner_mtv.jpg\" height=\"60\" width=\"62\" alt=\"Video School\" style=\"margin-bottom: 7px; margin-left: 35px;\"></a> <a href=\"our_project.html\"><img src=\"assets/images/partner_met.jpg\" height=\"60\" width=\"62\" alt=\"Video School\" style=\"margin-bottom: 7px; margin-left: 35px;\"></a> <a href=\"our_project.html\"><img src=\"assets/images/partner_port.jpg\" height=\"60\" width=\"62\" alt=\"Video School\" style=\"margin-bottom: 7px; margin-left: 35px;\"></a> <a href=\"our_project.html\"><img src=\"assets/images/partner_stb.jpg\" height=\"60\" width=\"62\" alt=\"Video School\" style=\"margin-bottom: 7px; margin-left: 35px;\"></a> <a href=\"our_project.html\"><img src=\"assets/images/partner_trinity.jpg\" height=\"60\" width=\"62\" alt=\"Video School\" style=\"margin-bottom: 7px; margin-left: 35px;\"></a></div>\n</div>\n</div>\n</div>','1','23','2','1','1','1','1426334234','1','1428585087','0','0','0','1426334234','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('9','document','text/html','Поделюсь своим','','','podelyus-svoim','','1','0','0','5','0','','<div class=\"center content home\" style=\"margin-top: 4px;\">\n<div class=\"row clearfix\">\n<div class=\"bigtitle\"><span>Поделюсь</span><br><span style=\"margin-left: 225px; margin-top: -35px;\">своим</span></div>\n<p class=\"article_video\">Если у вас есть прекрасные фото, но вы не знаете куда их засунуть. Вы считаете себя восходящей звездой фотоаппарата и объектива&hellip;. А может у вас есть пикантное домашнее видео, в которым вы просто три раза молодец&hellip;.либо просто смогли запечатлить гениальное событие и хотите чтобы о нем узнал весь город&hellip;. да что там город&hellip;.. вся Страна! Тогда у Вас есть уникальный шанс опубликовать свое видео и фото на самых мощных медийных площадках страны.</p>\n<p class=\"article_video\"><strong>Присылай свое фото или видео на почту <a class=\"arrow-link\" href=\"mailto:oprst.media@gmail.com\">oprst.media@gmail.com</a></strong> , и возможно завтра на Вас уже будут тыкать пальцем и просить автограф.<br>Лови момент!</p>\n<p class=\"article_video\"><strong>А теперь внимание!</strong><br>Все присланные Вами видео и фото будут выдвигаться на голосование среди постоянных зрителей. Авторы, набравшие большего всего голосов, получат подарки от ОПРСТ. Начните зарабатывать на своем видео уже сейчас.</p>\n<h3 class=\"table-header\">Технические данные</h3>\n<div class=\"sendInfo\" style=\"margin-left: 18px; margin-right: 4px;\">\n<h3>*Видео</h3>\n<table>\n<tbody>\n<tr>\n<td>Разрешение</td>\n<td>макс 1920х1080, мин 540х360, FPS 25\\50</td>\n</tr>\n<tr>\n<td>Продолжительность</td>\n<td>не более 30 минут</td>\n</tr>\n<tr>\n<td>Обязательно</td>\n<td>тема письма &laquo;Video&raquo; наличие описания к видео, не менее 100 символов.</td>\n</tr>\n<tr>\n<td>Допускается</td>\n<td>наличие своего логотипа, кроме левого верхнего угла</td>\n</tr>\n<tr>\n<td>Не допускается</td>\n<td>\n<p>видео, содержащее рекламный контент видео политической направленности видео, призывающие к нарушению правопорядка, с наличием резких экстремистских, расовых, религиозных и прочих враждебных высказываний, которые не являются шуткой, тонким юмором, а несут негативное и неуважительное отношение к другим homosapiensam&nbsp;</p>\n<p>видео содержащее порнографию. Но если качественная &ndash; присылайте, мы просто посмотрим.</p>\n</td>\n</tr>\n</tbody>\n</table>\n<div class=\"helpSendInfo\">*Видео заливается на Ваш канал Youtube.com , Ссылка отправляется в письме на наш e-mail с темой &laquo;Video&raquo; и описанием к видео.</div>\n<div class=\"showSendInfo\"><a href=\"[~47~]\">Посмотреть присланные видео</a></div>\n</div>\n<div class=\"sendInfo\" style=\"margin-right: 18px; margin-left: 4px;\">\n<h3>*Фото</h3>\n<table>\n<tbody>\n<tr>\n<td>Разрешение</td>\n<td>макс 2000х1300 pix, мин 1000х600 pix</td>\n</tr>\n<tr>\n<td>Количество</td>\n<td>не более 150 штук</td>\n</tr>\n<tr style=\"height: 67px;\">\n<td>Формат файла</td>\n<td>JPEG</td>\n</tr>\n<tr>\n<td>Обязательно</td>\n<td>архивация фотографий, формат ZIP либо RAR тема письма &laquo;Photo&raquo;</td>\n</tr>\n<tr>\n<td>Допускается</td>\n<td>наличие описания к фото (мероприятие, тематика, проч.) наличие своего логотипа, только в нижних углах</td>\n</tr>\n<tr>\n<td>Не допускается</td>\n<td>\n<p>использование платных файлообменников (прим. depositfiles, rapidshare, letitbit, turbobit и т.д.)</p>\n<p>фото, содержащее рекламный контент</p>\n<p>фото, содержащее политическую агитацию</p>\n<p>фото, содержащее запрещенную символику&nbsp;</p>\n</td>\n</tr>\n</tbody>\n</table>\n<div class=\"helpSendInfo\">*Фото заливается ОДНИМ АРХИВОМ в формате ZIP или RAR на свободный файлообменник (рекомендуемые: ЕХ.ua, облачные хранилища Yandex, Mail),ссылка отправляется в письме на наш e-mail.</div>\n<div class=\"showSendInfo\"><a href=\"[~58~]\">Посмотреть присланные фото</a></div>\n</div>\n</div>\n</div>','1','8','3','1','1','1','1426334251','1','1428669800','0','0','0','1426334251','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('10','document','text/html','Проекты-уекты','','','our_project.html','','1','0','0','0','1','','<p>В далёкие и древние времена, когда люди поклонялись Солнцу, а женщины не брили ноги - пророк Моисей предсказал, что - в 2015 году произойдёт ПРОРЫВ в интернет-пространстве, и человечество увидит второе пришествие сайта &laquo;ОПРСТ&raquo;. И если Вы сейчас читаете это и улыбаетесь, то Библейские пророчества сбываются прямо сейчас и Моисей не фуфлогон!</p>\n<p>Нам часто задают вопрос: &laquo;Чё за тупое название?&raquo; Так вот, отвечаем: &laquo;ОПРСТ&raquo; с китайского означает &laquo;сосуд, полный счастья&raquo;. Действительно, так и есть! Спросите у китайцев.<br>А по сути - это первый масштабный интернет видео-канал, в котором идеально гармонируют юмор и название вулкана Эйяфьядлайёкюдль, позитив и серые будни! Только у нас Вы сможете увидеть свежие новости через год!</p>\n<p>Мы постоянно развиваемся и не стоим на месте. И поэтому с радостью прислушаемся к вашим идеям и советам! Пишите, стучите, звоните, и мы осветим любое событие города, даже если это будет \"Битва полов 2\"! И ещё... не пугайтесь наших журналистов, если они к Вам пристали, значит, Вы им понравились!</p>\n<p>Achtung! Achtung! Attention! Attention! Внимание! Увага! Не говорите потом, что не видели! Канал ОПРСТ в своих репортажах выражает сугубо свое СУБЪЕКТИВНОЕ мнение о том, что творится в нашем городе (за исключением рекламной продукции). Вы можете считаться с нашим мнением, можете противиться его потоку (для этого есть место для комментариев), даже можете не верить в его существование - ВЫ ИМЕЕТЕ НА ЭТО ПРАВО!!! Так же, как и мы имеем право на свое субъективное (сугубо наше) мнение.</p>\n<p>Хорошего вам настроения, предохраняйтесь и не кашляйте!</p>','1','9','3','1','1','1','1426336270','1','1428484778','0','0','0','1426336270','1','','0','0','0','0','0','0','0','0');
