INSERT INTO `oprst_site_content` VALUES ('16','document','text/html','Контакты','','','contacts.html','','1','0','0','13','0','','<div class=\"content contacts\">\n<section>\n<h1 class=\"bigtitle\"><span>Контакты</span></h1>\n<div class=\"row clearfix\">\n<div class=\"left\">\n<h3>Мы находимся по адресу</h3>\n<div class=\"address\">ул. Энгельса, 26/2 (ор-р &laquo;Кишеня&raquo;)</div>\n<h3>Наш e-mail</h3>\n<div class=\"email\"><a href=\"mailto:1oprst@ukr.net\">1oprst@ukr.net</a></div>\n<div class=\"email\"><a href=\"mailto:reklama@oprst.com.ua\">reklama@oprst.com.ua</a></div>\n<h3>Наши телефоны</h3>\n<h4>Отдел по работе с клиентами:</h4>\n<div class=\"phone1\">(096) 96-056-73</div>\n<div class=\"phone2\">(097) 731-41-41</div>\n<h4>Заказ видео сьемки:</h4>\n<div class=\"small\">(студия, клип, репортаж, full-version, on-line трансляция)</div>\n<div class=\"phone2\">(096) 96-056-73</div>\n<h4>Администрация:</h4>\n<div class=\"phone2\">(097) 524-65-64</div>\n</div>\n<div class=\"right\">\n<h3>Мы на карте</h3>\n<div class=\"map\"><img src=\"assets/tpl/images/contacts-map.png\"></div>\n<h3>Мы в соцсетях</h3>\n<ul class=\"socials right\" id=\"&quot;inmap\'\">\n<li><a class=\"vk\" href=\"http://vk.com/oprstcomua\"></a></li>\n<li><a class=\"tw\" href=\"https://twitter.com/oprst_com_ua\"></a></li>\n<li><a class=\"fb\" href=\"http://www.facebook.com/groups/506884652659015/\"></a></li>\n<li><a class=\"gp\" href=\"https://plus.google.com/116192054864537564822/posts\"></a></li>\n</ul>\n</div>\n</div>\n<div class=\"row rules\">Все права соблюдены. При использовании видео-материалов сайта - активная ссылка на источник обязательна. За содержание материалов, размещаемых пользователями сайта, администрация ответственности не несет.</div>\n</section>\n</div>','1','21','0','1','1','1','1426337482','1','1428483752','0','0','0','1426337482','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('17','document','text/html','О нас','','','about_us.html','','1','0','0','13','0','','<div class=\"content about\">\n<section>\n<h1 class=\"bigtitle\"><span>Типо</span><br><span>о нас</span></h1>\n[!Ditto? &amp;tpl=`citate.item` &amp;parents=`322` &amp;display=`1` &amp;randomize=`1` &amp;sortBy=`menuindex` &amp;sortDir=`ASC` &amp;noResults=``!]\n<div class=\"row articles\">\n<ul class=\"bubles\">\n<li>\n<div>1</div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div>2</div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div>3</div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div>4</div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div></div>\n</li>\n<li>\n<div>5</div>\n</li>\n</ul>\n<article><img src=\"assets/tpl/images/about1.png\"> <span>Сначало было слово...</span>\n<p>В далёкие и древние времена, когда люди поклонялись Солнцу, а женщины не брили ноги - пророк Моисей предсказал, что - в 2015 году произойдёт ПРОРЫВ в интернет-пространстве, и человечество увидит второе пришествие сайта &laquo;ОПРСТ&raquo;. И если Вы сейчас читаете это и улыбаетесь, то Библейские пророчества сбываются прямо сейчас и Моисей не фуфлогон!</p>\n</article>\n<article><img src=\"assets/tpl/images/about2.png\"> <span>...потом мы выбрали название...</span>\n<p>Нам часто задают вопрос: &laquo;Чё за тупое название?&raquo; Так вот, отвечаем: &laquo;ОПРСТ&raquo; с китайского означает &laquo;сосуд, полный счастья&raquo;. Действительно, так и есть! Спросите у китайцев.</p>\n</article>\n<article><img src=\"assets/tpl/images/about3.png\"> <span>...купили мыльницу и <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; начали снимать...</span>\n<p>А по сути - это первый масштабный интернет видео-канал, в котором идеально гармонируют юмор и название вулкана Эйяфьядлайёкюдль, позитив и серые будни! Только у нас Вы сможете увидеть свежие новости через год!</p>\n</article>\n<article><span>...мы стали общаться...</span>\n<p>Мы постоянно развиваемся и не стоим на месте. И поэтому с радостью прислушаемся к вашим идеям и советам! Пишите, стучите, звоните, и мы осветим любое событие города, даже если это будет \"Битва полов 2\"!</p>\n</article>\n<article><img src=\"assets/tpl/images/about4.png\"> <span>...ОЧЕНЬ тесно...</span>\n<p>Не пугайтесь наших журналистов, если они к Вам пристали - значит&nbsp; Вы им понравились!</p>\n</article>\n<div><span>...до сих пор мы продолжаем работать на благо человечества и спасать планету</span></div>\n</div>\n<div class=\"row clearfix\">\n<div class=\"attention\">Attention! Внимание! Увага!<br> Не говорите о том, что не видели!</div>\n<article class=\"right right_attention\">Канал ОПРСТ в своих репортажах выражает сугубо свое СУБЪЕКТИВНОЕ мнение о том, что творится вокруг (за исключением рекламной продукции). Вы можете считаться с нашим мнением, можете противиться его потоку (для этого есть место для комментариев), даже можете не верить в его существование - ВЫ ИМЕЕТЕ НА ЭТО ПРАВО!!! Так же, как и мы имеем право на свое субъективное (сугубо наше) мнение.</article>\n</div>\n</section>\n</div>','1','15','1','1','1','1','1426337509','1','1428485101','0','0','0','1426337509','1','','0','0','0','0','0','0','0','1');
