INSERT INTO `oprst_site_content` VALUES ('38','document','text/html','Пятница 13-е в CrazyMaam','','','strah_i_uzas_na_levom_beregy','','1','1428559200','0','15','0','Ходит легенда, что суеверия, Фредди Крюгер, зомби, Джейсон и ещё какой то мужик с топором - гораздо веселее, если приправить их танцами и алкоголем.\nМы решили это проверить и отправились в клуб CrazzyMaam. В самую ночь, на пятницу 13-е... Всё ради Вас любимые зрители!\nНу а всем суеверным, предлагаем посмотреть видеоотчёт о выживших на самом безопасном канале Мариуполя ОПРСТ.','<p style=\"text-align: center;\"><span style=\"color: #888888;\">Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span style=\"color: #888888;\">Приятного просмотра:))</span></p>','1','12','0','1','1','1','1426584041','1','1428567973','0','0','0','1428559200','1','','0','0','0','0','0','0','0','1');
