INSERT INTO `oprst_site_content` VALUES ('40','document','text/html','День независимости','','','den_nezavisimosti_v_mariupole','http://oprst.com.ua/sobytiya/501-den-nezavisimosti-v-mariupole.html','1','1409741520','0','15','0','Еще совсем недавно она  была такой молодой и беспомощной и ничего не могла сделать самостоятельно, а сегодня она уже празднует свой 23 независимый день рождения! \nИсторически так сложилось, что нашему народу совершенно не нужен никакой повод, чтобы выпить, закусить и пуститься в пляс, а тут еще на руку какое-то могущественное день рождение припало. Нечасто такое встретишь, но именно в этот день складывается впечатление, будто в Украине проживает дружный народ. Все резко становятся побратимами, поют всем до боли знакомые песни, одни братья кричат что-то, другие отвечают им про героев, крепко целуются в десна… И так же резко уже на следующий день чувство единства теряется в какой-то \"неведомой *опе\".','<p style=\"text-align: center;\">Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением.</p>\n<p style=\"text-align: center;\">Приятного просмотра:))</p>','1','12','0','1','1','1','1426584165','3','1428443457','0','0','0','1409741520','3','','0','0','0','0','0','0','0','1');
