INSERT INTO `oprst_site_content` VALUES ('80','document','text/html','Я считаю, что ваше видео не объективно!','','','ya-schitayu-chto-vashe-video-ne-obektivno','','1','0','0','18','0','','<p>Канал ОПРСТ в своих репортажах выражает сугубо свое СУБЪЕКТИВНОЕ мнение о том, что творится в нашем городе (за исключением рекламной продукции).<br> Вы можете считаться с нашим мнением, можете противиться его потоку (для этого есть место для комментариев), даже можете не верить в его существование - ВЫ ИМЕЕТЕ НА ЭТО ПРАВО!!! Так же, как и мы имеем право на свое субъективное (сугубо наше) мнение.</p>','1','3','2','1','1','1','1427321894','1','1428186090','0','0','0','1427321894','1','','0','0','0','0','0','0','0','1');
