INSERT INTO `oprst_site_content` VALUES ('85','document','text/html','Шаровые соревнования','','','studentu_shaga_sharovue_sorevnovaniya','http://oprst.com.ua/nashi-prekty/videootchet/496-studenty-shaga-i-sharovye-sorevnovaniya.html','1','1407927240','0','15','0','Кто сказал, что компьютерные умы ничего не умеют, кроме, как смотреть в мониторы?!\n\nКомпьютерная академия ШАГ совместно с РЦ \"Сити-боулинг\" организовали турнир по боулингу среди студентов и преподавателей КА ШАГ.\n\nПрограммисты, администраторы и дизайнеры показали всем, что \"шарят\" в игре с шарами. wink\nСмотри подробности в нашем репортаже!','<p style=\"text-align: center;\"><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p><span>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Приятного просмотра:))</span></p>','1','12','10','1','1','1','1427530619','3','1428443501','0','0','0','1407927240','3','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('86','document','text/html','Бэтмены в \"Солнечном\"','','','batman_v_solnechnom','http://oprst.com.ua/nashi-prekty/videootchet/492-betmeny-v-solnechnom.html','1','1407322680','0','15','0','На днях нашу съёмочную группу потрясло сразу три немаловажных события:\n\n1. Мы узнали, кто же всё таки поёт песню \"Потому, что я BATMAN\"\n\n2. Это не единственный хит у этих ребят\n\n3. И, наконец, побывать на грандиозном концерте группы MMDANCE в детском оздоровительном лагере \"Солнечный\"\n\nВсе подробности события смотри в нашем репортаже!','<p style=\"text-align: center;\"><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp; &nbsp; &nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span></span>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Приятного просмотра:))</p>','1','12','11','1','1','1','1427531465','3','1428443553','0','0','0','1407322680','3','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('87','document','text/html','Любовь на \"Райском\"','','','lubov_na_raiskom','http://oprst.com.ua/nashi-prekty/videootchet/490-lyubov-na-rayskom.html','1','1406891280','0','15','0','1. Тематические вечеринки сейчас стали редкостью, соответственно было приятно поприсутствовать.\n2. На конкурсе воссоединились два одиноких сердца!!! Но вдвойне приятней понимать, что за это время воссоединились еще несколько сердец, пусть даже и на одну ночь.\n3. Под утро люди так веселились, что впали в детство - танцевали , играли в догонялки, падали , прыгали высоко поднимая ручки.\n4. Музыка зажигательная, свет поджигательный, напитки обжигающие.\n5. Все посетители смогли отпраздновать день рождения Ани. Многие даже не знали какой именно! ))\n \n\n\n\n\n\n\n\n1. Красиво жить не запретишь. Несколько десятков женатых мужчин пытались настоятельно рекомендовать нашим операторам не снимать их. В свою очередь мы настоятельно рекомендуем мужчинам либо спать с женами, либо одевать в клуб маску.\n2. Девушки на конкурсе были, откровенно говоря, не красавицы. Наше мнение подтвердили даже выкрики из зала. Мы настоятельно рекомендуем девушкам либо не участвовать в таких мероприятиях, либо также одевать маску.\n3. Любителям поесть в клубе советуем садится по краям, а не в центре зала. В центре Вас толкнут, заденут, выбьют вилку из руки, а то и отберут салат.\n4. Девушки! После 12.00 снимайте каблуки. Иначе потом наши золушки падают, скользят, а иногда и пытаются повиснуть и отдохнуть на проходящем мимо операторе.\n5. Советуем усилить фейс-кнтроль в клубе, т.к. некоторые ,видимо, в клуб пришли съесть беляш и выпить пива.','<p style=\"text-align: center;\"><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span></span>&nbsp; &nbsp; &nbsp; &nbsp;Приятного просмотра:))</p>','1','12','12','1','1','1','1427531914','1','1427627289','1','1428355819','1','1406891280','1','','0','0','0','0','0','0','0','1');
