INSERT INTO `oprst_site_content` VALUES ('91','document','text/html','Наконец то пришло лето!','','','nakonets_to_prishlo_leto','http://oprst.com.ua/sobytiya/481-nakonec-to-prishlo-leto.html','1','1404385740','0','15','0','После затянувшегося июня, который больше был похож на октябрь, до нас докатилось настоящее ЛЕТО!!!\n\nЖара, пляж и шум прибоя скрасили отдых Мариупольцев на прошедших выходных. Вся молодёжь Мариуполя собралась на городском пляже, что бы принять участие в конкурсах и поучаствовать в состязании песочно-архитектурного искусства. А те кому было жарко на пляже могли скрыться в тени городского сада и посмотреть на проходивший там концерт.\n\nВообщем выходные удались! Ура, товарищи!!!','<p style=\"text-align: center;\"><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;</span></p>\n<p style=\"text-align: center;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Приятного просмотра:))</span></p>','1','12','16','1','1','1','1427534011','3','1428526235','0','0','0','1404385740','3','','0','0','0','0','0','0','0','1');
