INSERT INTO `oprst_site_content` VALUES ('94','document','text/html','Дети - цветы жизни!','','','deti-cvety-zhizni','http://oprst.com.ua/nashi-prekty/intervyu/475-deti-cvety-zhizni.html','1','1402312200','0','15','0','Дети - цветы жизни! И с этим не поспорить!\n\nБез детей не было бы взрослых, а без взрослых - детей!!!\n\nИменно по этому ТРЦ ПортCity 1 июня устроили грандиозный праздник для нашего \"цветника\".\n\nМы уже посмотрели, чем же радовали организаторы своих гостей. Так посмотри же и ТЫ!','<p style=\"text-align: center;\"><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span>Приятного просмотра:))</span></p>','1','12','15','1','1','1','1427538368','1','1427627449','1','1428355843','1','1402312200','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('95','document','text/html','Драка сосисек 2014','','','draka-sosisek-2014','http://oprst.com.ua/nashi-prekty/intervyu/474-draka-sosisok-2014.html','1','1402139460','0','15','0','Заварили кашу, насыпали соли на рану, подлили масла в огонь! Нет, это не политика! Это битва поворов в \"Месте встречи\".\n\nЛучшие шеф-повара заведений Мариуполя сражались за звание быть лучшим из лучших!\n\nКонечно же наша съёмочная группа не могла пропустить этого грандиозного парада блюд. Чем удивляли гостей повара смотри в нашем репортаже!','<p style=\"text-align: center;\"><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span>Приятного просмотра:))</span></p>','1','12','16','1','1','1','1427538557','1','1427627465','1','1428355851','1','1402139460','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('96','document','text/html','\'Plast Dance\'','','','shou-balet-plast-dance','http://oprst.com.ua/ne-nashe/470-shou-balet-plast-dance.html','1','1406707320','0','15','0','Талантливый человек - талантлив во всём!\nМариупольская молодёжь продолжает доказывать свои талаты. Вместо того чтобы пить пивко на море ребята собрались и организовали свою шоу-группу.\nПосмотри что они могут на нашем канале.','<p style=\"text-align: center;\"><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span>Приятного просмотра:))</span></p>','1','12','17','1','1','1','1427538866','1','1428355222','0','0','0','1406707320','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('97','document','text/html','Прощай лицей','','','proshhaj-licej-zdravstvuj-vzroslaya-zhizn','http://oprst.com.ua/ne-nashe/469-proschay-licey-zdravstvuy-vzroslaya-zhizn.html','1','1406548800','0','15','0','В пятницу, 29 мая, во всех школах и лицеях Мариуполя прозвучал последний звонок, который для выпускников стал путёвкой во взрослую жизнь.\nВыпускники МГЛ запечатлели этот знаменательный день, и показали, что не нужно грустить, а нужно радоваться каждой перемене в жизни.\nСмотри ролик от выпускников на нашем канале!','<p style=\"text-align: center;\"><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span>Приятного просмотра:))</span></p>','1','12','18','1','1','1','1427539020','1','1428223381','1','1428355305','1','1406548800','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('98','document','text/html','\"Максимум\" и \"Радость\"','','','otchetnyj-koncert-maksimum-i-radost','http://oprst.com.ua/nashi-prekty/videootchet/462-otchetnyy-koncert-maksimum-i-radost.html','1','1401016260','0','15','0','18 мая в ДК Металлургов состоялся отчётный концерт шоу-группы \"Максимум\" и театра песни \"Радость\".\n\nМальчишки и девчонки от мала до велика радовали зрителей незабываемой яркой шоу-программой. Ну и конечно же наша съёмочная группа на смогла обойти стороной такое действо!\n\nЧто мы там подсмотрели - смотри в репортаже на нашем канале!','<p style=\"text-align: center;\"><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span>Приятного просмотра:))</span></p>','1','12','19','1','1','1','1427539447','3','1428612752','0','0','0','1401016260','3','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('99','document','text/html','Открытие автомойки','','','otkrytie-mobilnoj-avtomojki-na-tc-amstor','http://oprst.com.ua/nashi-prekty/videootchet/461-otkrytie-mobilnoy-avtomoyki-na-tc-amstor.html','1','1400843520','0','15','0','Сегодня в Мариуполе был открыт очередной пункт мобильной автомойки AutoClean на ТЦ Амстор.\n\nЧто же из себя представляет мобильная автомойка?\n\nМобильная автомойка - это экологически чистый способ сухой мойки автомобиля, не требующий специальных приспособлений!\n\nМобильная автомойка позволяет:\n\n- сэкономить время и деньги на посещении обычной автомойки;\n\n- вызвать специалистов в любую точку города и они отмоют вашу машину;\n\n- обратиться к специалистам на парковке возле супермаркета, и они помоют Вам машину, пока вы заняты покупками;\n\n- купить средства для чистки машины и самостоятельно помыть машину БЕЗ РАЗВОДОВ!\n\nУзнайте больше об услугах мобильной автомойки AutoClean на официальном сайте: http://autoclean.org.ua/\n\nА также смотри наш блестящий репортаж с торжественного открытия!','<p><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Приятного просмотра:))</span></p>','1','12','20','1','1','1','1427539717','1','1428088401','1','1428356126','1','1400843520','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('100','document','text/html','РЭПчик, ролики и МГУ','','','repchik-roliki-i-mgu','http://oprst.com.ua/ne-nashe/459-repchik-roliki-i-mgu.html','1','1399979520','0','15','0','Студенты-первокурсники из МГУ не постеснялись, а ты и дальше сиди перед компом!\n\nРебята взяли камеру, ролики, подключили креатив и сняли вполне крутой FUN-клип на трек украинского рэпера Ярмака - Мечта.\n\nЧто получилось у юных дарований смотри на нашем канале!','<p style=\"text-align: center;\"><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span>Приятного просмотра:))</span></p>','1','12','21','1','1','1','1427539905','1','1428254387','0','0','0','1399979520','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('101','document','text/html','Сработаемся! Компания Trinity.','','','srabotaemsya-kompaniya-trinity','http://oprst.com.ua/nashi-prekty/srabotaemsya/458-srabotaemsya-kompaniya-trinity.html','1','1399461120','0','15','0','В этот солнечный майский день мы запускаем новый проект!\n\nВ этом проекте мы хотим рассказать Вам о том, что же происходит за стенами тех организаций, которые Вас обслуживают.\n\nОт куда берётся интернет? Как варят пиво? Из чего делают шоколад? - На все эти и другие вопросы Вы найдёте ответы в нашей программе \"Сработаемся!\" с Ириной Затеевой. \n\nИ сегодня наша съёмочная группа отправилась в \"тайное царство\" компании Trinity. Что же мы там узнали - смотри ТОЛЬКО на нашем канале!!!','<p style=\"text-align: center;\"><span style=\"color: #888888;\">Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span style=\"color: #888888;\">Приятного просмотра:))</span></p>','1','12','22','1','1','1','1427540176','3','1428531060','0','0','0','1399461120','3','','0','0','0','0','0','0','0','1');
