INSERT INTO `oprst_site_content` VALUES ('124','document','text/html','FUN-ФАКТОР 2014','','','fun-faktor-2014','http://oprst.com.ua/sobytiya/408-fun-faktor-2014.html','1','1394194920','0','15','0','«FUN-ФАКТОР» - самое масштабное детское талант-шоу города Мариуполя.\n\nУчастие в конкурсе приняли все желающие от 4 до 16 лет абсолютно БЕСПЛАТНО.\nВ этом сезоне участники демонстрировали свои способности в 4 номинациях:\n-вокал;\n-хореография;\n-уникальный жанр;\n-детское творчество (рисование, фотография,hand-made, вышивка, бисероплетение итд.).\nГала-концерт и выставка творческих работ участников прошли на территории ТРЦ «ПортCity»в первый день весны - 1 марта\nСмотри МЕГА-шоу на нашем МЕГА-канале!','<p style=\"text-align: center;\"><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp; &nbsp; &nbsp;&nbsp;</span>&nbsp;</p>\n<p style=\"text-align: center;\">&nbsp; &nbsp; &nbsp; &nbsp;Приятного просмотра:))</p>','1','12','45','1','1','1','1427546503','1','1427628176','1','1428356334','1','1394194920','1','','0','0','0','0','0','0','0','1');
