INSERT INTO `oprst_site_content` VALUES ('158','document','text/html','Никита Ломакин в Мариуполе','','','nikita-lomakin-v-mariupole','http://oprst.com.ua/sobytiya/356-nikita-lomakin-v-mariupole.html','1','1387630080','0','15','0','Юный симферополец Никита Ломакин 14 декабря впервые дал сольный концерт в Мариуполе. До этого в нашем городе Никита еще не бывал, но обрадовался теплой встрече со стороны поклонниц и организаторов мероприятия с мариупольской стороны.','<p style=\"text-align: center;\"><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span>Приятного просмотра:))</span></p>','1','12','79','1','1','1','1427562945','1','1427629709','1','1428440291','3','1387630080','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('159','document','text/html','Parodies Night @ BomBey','','','parodies-night-bombey','http://oprst.com.ua/nashi-prekty/videootchet/355-parodies-night-bombey.html','1','1387457280','0','15','0','Клуб БомБей продолжает серию самых ярких и незабываемых вечеринок этого года. На этот раз организаторы решили обрушить на головы мариупольцев настоящий звёздный калейдоскоп. Сразиться в танцевальном батле с ожившим королём поп-музыки Майклом Джексоном, зажечь под хиты неподражаемого Фредди Меркьюри, заглянуть под юбку великолепной Мерелин Монро, ну и конечно же всем хотелось обставить эпатажную Леди Гагу и выиграть фирменный Star-коктейль. Вечеринка получилась по настоящему жаркой, а от звёздного блеска рябило в глазах. Впереди новогодние праздники, мы уверены, что клуб БомБей подарит ещё не одну безумную вечеринку!','<p style=\"text-align: center;\"><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span>Приятного просмотра:))</span></p>','1','12','80','1','1','1','1427563272','1','1427629726','1','1428440295','3','1387457280','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('160','document','text/html','Выиграй Макбук!','','','vyigraj-makbuk','http://oprst.com.ua/reklama/352-vyigray-makbuk.html','1','1387370880','0','15','0','УРА! Регистрация на чемпионат компьютерных талантов «ЗОЛОТОЙ БАЙТ   2014» — открыта!САЙТ: www.goldenbyte.org\n\nИ ещё одна прияная новость!   В этом году чемпионат вышел   за границы Украины  и приобрел статус международного!\nМеждународный IT-чемпионат «Золотой Байт» основан Компьютерной Академией «ШАГ» в  2007 году. Конкурс ориентирован  на молодое,прогрессивное поколение, которое стремится проявить   и реализовать свои способности  в сфере IT-технологий, дизайна   и коммуникаций. За 7 лет существования чемпионата,   в нёмприняло участие более   20 000 человек, было представлено более   7 000 работ, общий призовой фонд составил   2 000 000 гривен!   В этом году  в конкурсе примут участия представители: Украины, России, Белоруссии, Казахстана, Литвы, Латвии, Эстонии, Грузии   и других стран.\n\n \n\nУчастники «Золотого Байта-2011» стали победителями Imagine Cup, престижного международного турнира.  В 2012 году проект студентов Академии, участников чемпионата «Золотой Байт», вошёл   в ТОП-10 лучших изобретений по версии   журнала TIME.\n\nПризовой фонд Чемпионата   в этом году составит более   500 000 гривен!\n\n \n\n\nНоминации «Золотого   Байта — 2014»:\n\nStartup challenge (конкурс программных проектов)\nNetworking technology (номинация для системных администраторов)\nMobile devolopment (конкурс мобильных приложений)\nGame design (конкурс по созданию игр)\nCharacter design (конкурс по созданию игровых персонажей)\nWeb-design (конкурс   web-проектов)\nShort movie (конкурс короткометражных фильмов)\nJunior competition (конкурс для детей 10–14 лет)\n\nНапомним, что   в прошлом году в «Золотом   Байте — 5», мариупольская команда   I-Dev   в составе специалиста  и студентки компьютерной Академии «ШАГ» Евченко Станислава   и Харченко Екатерины заняли первое место по Украине   в номинации Windows jazz, а   их бизнес-проект вошел  в пятерку самых успешных проектов страны  в номинации «Магистр проектов».  ПОДРОБНЕЕ: http://mariupol.itstep.org/novosti-na-glavnoy/mi-luchshie-mariupol-priv%D1%91z-kubok-zolotogo-bayta-5.html\n\nЧемпионат проводится при поддержке   Премьер-министра Украины Николая Азарова, Кабинета министров Украины, Министерства образования  и науки, Государственного агентства Украины по вопросам науки, инноваций   и информатизации,   в партнерстве   с лидерами   IT-отрасли: корпораций Microsoft, Autodesk, Intel, InterSystems, Imperiousgroup, бизнес-инкубатора HappyFarm, Sterling Studio   и другими.\n\nВся информация   об условиях участия   в Чемпионате доступна   на сайте www.goldenbyte.org','<p style=\"text-align: center;\"><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span>Приятного просмотра:))</span></p>','1','12','81','1','1','1','1427563559','1','1427629738','1','1428440299','3','1387370880','1','','0','0','0','0','0','0','0','1');
