INSERT INTO `oprst_site_content` VALUES ('163','document','text/html','FUN-Фактор Мариуполь','','','fun-faktor-mariupol','http://oprst.com.ua/sobytiya/339-fun-faktor-mariupol.html','1','1386336540','0','15','0','30 ноября в ТРЦ «ПортCity» состоялся гала-концерт масштабного талант-шоу «FUN-ФАКТОР» на котором выступили двадцать финалистов в направлениях вокала, хореографии и  оригинального жанра. Возраст участников колебался от пяти до четырнадцати лет. \nНапомним, что отборочные кастинги проходили почти месяц, за это время в них приняло участие почти двести детей, но в финал прошли только лучшие из лучших. \nОрганизатором же такого глобального талант-шоу является СЦР «Фунтура».\nВнимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением.                Приятного просмотра:))','<p style=\"text-align: center;\"><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Приятного просмотра:))</span></p>','1','12','84','1','1','1','1427573825','1','1427632180','1','1428440312','3','1386336540','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('164','document','text/html','Мостовой - Белые цветы','','','mostovoj-belye-cvety','http://oprst.com.ua/ne-nashe/333-mostovoy-belye-cvety.html','1','1385902260','0','15','0','На телеканале «СТБ» состоялся 6 прямой эфир шоу «Х фактор», в котором принимает участие мариуполец Михаил Мостовой.\n\nНа этот раз все конкурсанты исполняли кавер-версии известных песен. Михаил самостоятельно выбрал композицию для себя, против которой выступал его наставник Сергей Соседов. Он исполнил хит Аллы Пугачевой «Белые цветы» в необычной обработке. На сцене мариуполец появился в образе рокера.\n\nТакое выступление очень порадовала судью Ирину Дубцову, которая поблагодарила Михаила за правильный выбор песни. Также поддержал артиста и Серега, подчеркнув, что Мише удалось спеть женскую песню действительно по–мужски, а вот Игорь Кондратюк был разочарован неправильными акцентами. По его словам, Мостовой вместо того, чтобы выделить слово «купала», делала акцент на слове «золотые».\n\nНо для певца данная критика значения не имела, для него было гораздо важнее достучаться до зрителя. Оказывается, в детстве Михаил был худеньким скромным мальчиком, которого все обижали. Уже затем, накачав мускулы, он спрятал свою душу под маской железного человека. Теперь же мариуполец должен раскрыть свою душу, чтобы его услышали, поняли и полюбили.\n\nЗа свою искренность Мостовой получил награду – зрители поддержали конкурсанта и подарили ему путевку в следующий тур. В субботу, 7 декабря, он исполнит песню из кинофильма.','<p style=\"text-align: center;\"><span style=\"color: #888888;\">Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span style=\"color: #888888;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Приятного просмотра:))</span></p>','1','12','85','1','1','1','1427574095','3','1428530276','0','0','0','1385902260','3','','0','0','0','0','0','0','0','1');
