INSERT INTO `oprst_site_content` VALUES ('166','document','text/html','День Студента БОМБЕЙ','','','den-studenta-bombej','http://oprst.com.ua/nashi-prekty/videootchet/328-den-studenta-bombey.html','1','1385124660','0','15','0','«Зачётная» суббота в новом ночном клубе «БомБей»!\n\nДень студента это всегда круто! А еще круче встретить его в клубе БомБей. И не важно, изучаешь ли ты химию, любишь ли этот предмет вообще - бесплатная лотерея «Зачет» и коктейль «Шпора» тебе гарантированы. Такой необычный день студента состоялся 16 ноября в ночной клубе БомБей. Всем запомнилась строгая училка МС Лидия Романовна и незабываемое бармен-шоу от Менделеева, экстравагантный DJ Ректор и его GO-GO Лаборантка. А еще на этом эксклюзивном Дне студента можно было мастерски обыграть препода и почувствовать настоящий драйв даже на таком обыденно-скучном занятии как урок химии. Вечеринка удалась! И наверняка для кого-то это в самом деле был лучший День студента.\n','<p style=\"text-align: center;\"><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Приятного просмотра:))</span></p>','1','12','87','1','1','1','1427574651','1','1428255020','1','1428440324','3','1385124660','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('167','document','text/html','Рецепт от Литвинковича','','','recept-ot-litvinkovicha','http://oprst.com.ua/sobytiya/325-recept-ot-litvinkovicha.html','1','1384087920','0','15','0','10 ноября, в рамках большого всеукраинского тура «К тебе», в Мариуполе состоялся концерт Евгения Литвинковича. В нашем городе артист выступает уже в третий раз, тем не менее, с сольным концертом –  впервые. Цветы звезде дарили, начиная с самой первой песни, а аплодисменты в зале не стихали в течение всего концерта.  По признанию самого Евгения, Мариуполь ему запомнится навсегда и не только публикой, которая принимает его «на ура», но и тем, что здесь он впервые увидел море.','<p style=\"text-align: center;\"><span style=\"color: #888888;\">Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span style=\"color: #888888;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Приятного просмотра:))</span></p>','1','12','88','1','1','1','1427575051','3','1428530268','0','0','0','1384087920','3','','0','0','0','0','0','0','0','1');
