INSERT INTO `oprst_site_content` VALUES ('172','document','text/html','Вечер психов в Мариуполе','','','vecher-psihov-v-mariupole','http://oprst.com.ua/nashi-prekty/videootchet/336-psihoparty-na-bombee.html','1','1386075060','0','15','0','Пожалуй, это была самая экстравагантная в Мариуполе вечеринка этого года! Симпатичные медсестры сверкали улыбками,  врачи у барной стойки щедро наливали самое вкусное лекарство,  а главврач прокачивал танцпол своими лучшими dj-сетами! Незабываемые впечатления, море веселья  и захватывающих эмоций подарил Бомбей своим посетителям в последний день осени. Ждем зимних эксклюзивов от БомБея.','<p style=\"text-align: center;\"><span style=\"color: #888888;\">Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span style=\"color: #888888;\">Приятного просмотра:))</span></p>','1','12','93','1','1','1','1427610293','3','1428530258','0','0','0','1386075060','3','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('173','document','text/html','Калейдоскоп МГУ','','','kalejdoskop-mgu','http://oprst.com.ua/sobytiya/322-kaleydoskop-mgu.html','1','1384519920','0','15','0','05.11.2013 состоялся 3 этап смотра-конкурса Дебют первокурсника \"ТВОРЧЕСКИЙ КАЛЕЙДОСКОП!». Все 5 команд факультетов показали высокий уровень подготовки. Первокурсники старались выложиться на все 100% и представить достойно факультет, на котором обучаются. Зрители получили море положительных эмоций и ярких впечатлений. Места расположились следующим образом:\n\nI - исторический факультет\nII - экономико-правовой факультет\nIII - филологический факультет\n\nДипломами участников были награждены факультет греческой филологии и факультет иностранных языков.','<p style=\"text-align: center;\"><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span>Приятного просмотра:))</span></p>','1','12','94','1','1','1','1427611094','1','1427629964','1','1428440400','3','1384519920','1','','0','0','0','0','0','0','0','1');
