INSERT INTO `oprst_site_content` VALUES ('179','document','text/html','Творческий калейдоскоп(full)','','','tvorcheskij-kalejdoskopfull','http://oprst.com.ua/nashi-prekty/polnaya-versiya/344-tvorcheskiy-kaleydoskopfull.html','1','1383828840','0','15','0','05.11.2013 состоялся 3 этап смотра-конкурса Дебют первокурсника \"ТВОРЧЕСКИЙ КАЛЕЙДОСКОП!». Все 5 команд факультетов показали высокий уровень подготовки. Первокурсники старались выложиться на все 100% и представить достойно факультет, на котором обучаются. Зрители получили море положительных эмоций и ярких впечатлений. Места расположились следующим образом:\n\nI - исторический факультет\nII - экономико-правовой факультет\nIII - филологический факультет\n\nДипломами участников были награждены факультет греческой филологии и факультет иностранных языков.','<p style=\"text-align: center;\"><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span>Приятного просмотра:))</span></p>','1','12','100','1','1','1','1427612757','1','1427630068','1','1428440415','3','1383828840','1','','0','0','0','0','0','0','0','1');
