INSERT INTO `oprst_site_content` VALUES ('190','document','text/html','Парад звёзд','','','parad-zvyozd-v-centre-mariupolya','http://oprst.com.ua/nashi-prekty/videootchet/494-parad-zvezd-v-centre-mariupolya.html','1','1407754680','0','15','0','Давно мариупольцы не видели такого количества звёзд у себя в городе!\nА тут целая плеяда, да ещё и бесплатно. Танцы, песни и веселье заполонили театральную площадь!\nВообщем народ отдохнул на славу, вот только, концерт был в понедельник =( ...','<p style=\"text-align: center;\"><span style=\"color: #888888;\">Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span style=\"color: #888888;\">Приятного просмотра:))</span></p>','1','12','110','1','1','1','1427626689','3','1428530146','0','0','0','1407754680','3','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('240','document','text/html','Метаморфозы 9','','','metamorfozy-9','http://oprst.com.ua/ne-nashe/253-metamorfozy-9.html','1','1378286880','0','15','0','В новом выпуске эксклюзивного проекта «Метаморфозы» мы расскажем вам совершенно удивительную историю перевоплощения, которая произошла с нашей героиней Натальей. \nДолгое время Наталья жила в круговороте ежедневных забот, совершенно позабыв о своем здоровье и красоте. Но в один момент она решила изменить себя, хотя понимала, что не справится без помощи профессионалов.\nИ в феврале этого года Наталья обратилась первым делом в Медицинский центр \"Ирида Лаб\", где под чутким руководством врача-диетолога Скильсаровой Ирины Дмитриевны наша героиня сумела уменьшить свой вес более, чем на 20 килограмм.\n\nНу, а затем, для завершения своего нового образа, для кардинального изменения своего стиля и внешнего вида, Наталья пришла к настоящим профессионалам – центр дерматологии и врачебной косметологии «Шанти» подарили нашей героини волшебные процедуры для кожи лица и тела, стилист и визажист Оксана Дорофеева подарила героине новый образ, магазин свадебной и вечерней моды «Mi Amor» - новый стиль. Ну, а долгожданная встреча Натальи после всех перевоплощений с ее любимым супругом произошла в волшебном и уютном ресторане дальних плаваний «Ви Марко», с вкусным авторским подарком от Марины Игнатьевой.','<p style=\"text-align: center;\"><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Приятного просмотра:))</span></p>','1','12','137','1','1','1','1428226033','3','1428530038','0','0','0','1378286880','3','','0','0','0','0','0','0','0','1');
