INSERT INTO `oprst_site_content` VALUES ('193','document','text/html','Посвящение в студенты МГУ vs ПГТУ','','','posvyashhenie-v-studenty-mgu-vs-pgtu','http://oprst.com.ua/sobytiya/293-posvyaschenie-v-studenty-mgu-vs-pgtu.html','1','1382462160','0','15','0','Уважаемые зрители, подписчики, друзья и случайно заглянувшие!\n\nПочти уже 2 месяца назад вы видели полные версии посвящений в студенты мгу и пгту, которые были проведены во дворце «металлургов».\nмы не стали делать репортажи, дабы не задеть ещё неокрепшие чувства молодых студентов, но.... как ни странно, мы получили большое количество просьб от студентов мгу и пгту, чтобы всё-таки наше субъективное мнение канала \"опрст\" было озвучено!\nчто ж, по вашим просьбам, когда уже поутихли баталии, мы выпускаем одновременно два репортажа. посвящение в студенты мгу и пгту!\nвот примерно как-то так мы это видели со своей стороны!\nвас же, дорогие зрители, мы хотели спросить:\nкакой репортаж вам понравился больше? голосуем!\nГолосование привязано к аккаунту в \"ВК\" во избежание накрутки голосов и проводится АНОНИМНО!','<p style=\"text-align: center;\"><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span>Приятного просмотра:))</span></p>','1','12','113','1','1','1','1427649737','1','1427649737','1','1428440462','3','1382462160','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('194','document','text/html','Смирнов и КсенАрмия','','','smirnov-i-ksenarmiya','http://oprst.com.ua/sobytiya/287-smirnov-i-ksenarmiya.html','1','1382376120','0','15','0','В субботу, 12 октября в Мариуполе в ночном клубе \" Imperial\" состоялся концерт финалиста шоу «Х-фактор» Алексея Смирнова.\n\nНа концерт пришли десятки поклонников таланта мариупольца. Певец же, в свою очередь, подарил зрителям свою концертную программу, которая состояла, как из песен, звучавших на талант-шоу, так и из тех, которые он написал для свой группы «Аmano».\n\n«Всем спасибо за то, что пришли на концерт... Для меня это очень важно... люблю вас, КсенАрмия!» - написал Алексей на своей странице \"Вконтакте\" сразу после окончания концерта.\n\nКак же концерт прошёл на самом деле? Самые откровенные вопросы в интервью от фанатов... Приятного просмотра!\n\nСамый яркий фотоотчёт ТУТ: http://oprst.com.ua/photos/kaluzniy-g/285-aleksey-smirnov-v-mariupole.html','<p style=\"text-align: center;\"><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span>Приятного просмотра:))</span></p>','1','12','114','1','1','1','1427650019','1','1427650019','1','1428440466','3','1382376120','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('195','document','text/html','Михаил Мостовой на Х-фактор','','','mihail-mostovoj-na-h-faktor','http://oprst.com.ua/ne-nashe/290-mihail-mostovoy-na-h-faktor.html','1','1382030820','0','15','0','Михаил Мостовой из нашего родного города Мариуполя, исполняет песню Alessandro Safina \"Luna Tu\" на кастинге Х-фактора-4 в Тренировочном лагере. \n\nНапомним, что ранее с песней \"Luna Tu\", выступал Александр Кривошако - также наш земляк, участник Первого сезона \"Х-фактор\". http://www.youtube.com/watch?v=wh-FggDvYHs\n\nПоддержим Михаил Мостового и.... приятного просмотра!','<p style=\"text-align: center;\"><span style=\"color: #888888;\">Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span style=\"color: #888888;\">Приятного просмотра:))</span></p>','1','12','115','1','1','1','1427651469','3','1428530138','0','0','0','1382030820','3','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('196','document','text/html','МЕТАМОРФОЗЫ 10','','','metamorfozy-10','http://oprst.com.ua/ne-nashe/283-metamorfozy-10.html','1','1381773060','0','15','0','Эксклюзивный видео проект «Метаморфозы» меняет не только жизнь своих героинь, но также меняется и сам. В новом выпуске вас ждут приятные и удивительные изменения проекта, новый сюжет и, конечно же, героини. \n\nДа, именно так. На этот раз в нашем выпуске у нас будет не одна, а сразу три прекрасные девушки, которые решили кардинально изменить себя. ','<p style=\"text-align: center;\"><span style=\"color: #888888;\">Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span style=\"color: #888888;\">Приятного просмотра:))</span></p>','1','12','116','1','1','1','1427657574','3','1428530132','0','0','0','1381773060','3','','0','0','0','0','0','0','0','1');
