INSERT INTO `oprst_site_content` VALUES ('238','document','text/html','Посвящение в студенты МГУ','','','posvyashhenie-v-studenty-mgu','http://oprst.com.ua/nashi-prekty/polnaya-versiya/265-posvyaschenie-v-studenty-mgu.html','1','1380099540','0','15','0','Более 1500 человек стали в этом году студентами Мариупольского государственного университета. Студенты заполнили зрительный зал Дворца металлургов, где состоялась церемония посвящения первокурсников в студенты. \nКстати, среди виновников торжества были не только мариупольцы и вчерашние абитуриенты из 12 областей Украины, но граждане России, Китая, Греции, Турции, Армении, Азербайджана, Узбекистана, Туркменистана, поступишие в приазовский вуз.\nНовоиспеченных студентов поздравили ректор МГУ Константин Балабанов, городской голова Юрий Хотлубей, народные депутаты Украины Владимир Бойко, Алексей Белый, Сергей Матвиенков, руководители предприятий города и другие гости.','<p style=\"text-align: center;\"><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span>&nbsp;&nbsp;Приятного просмотра:))</span></p>','1','12','135','1','1','1','1428224256','1','1428255322','1','1428440516','3','1380099540','1','','0','0','0','0','0','0','0','1');
