INSERT INTO `oprst_site_content` VALUES ('224','document','text/html','MarioBrothers на диване','','','divan-i-mario','','1','1428822000','0','15','0','Мы к вам заехали на час, вам крупно повезло... \nРесторан-клуб \"DiVan\" принимал у себя в гостях метров мариупольской восьми-битной музыки - Mario Brothers. Песню спели, баян порвали, дракона победили,  принцессу спасли.','<p style=\"text-align: center;\"><span style=\"color: #888888;\">Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span style=\"color: #888888;\">Приятного просмотра:))</span></p>','1','12','121','1','1','1','1428193081','1','1428823387','0','0','0','1428822000','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('225','document','text/html','Пиратская вечеринка','','','piratskaya-vecherinka','','1','1428913380','0','15','0','Если Вам подбросили \"чёрную метку\", то быть беде. Если подкинули голубую, то... это тоже ничего хорошего!\nКак праздновал пиратскую вечеринку самый морской клуб Мариуполя, смотрите в нашей пиратской копии.\nЙо-хо-хо, Коралл и ОПРСТ!','<p style=\"text-align: center;\"><span style=\"color: #888888;\">Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span style=\"color: #888888;\">Приятного просмотра:))</span></p>','1','12','122','1','1','1','1428193300','1','1428921217','0','0','0','1428913380','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('226','document','text/html','Камера, мотор, ОПРСТ!','','','otkrytie-oprst','','1','1428181200','0','15','0','Этот день настал! \nМы ждали встречи с Вами, и готовы творить, радовать, стебать, подкалывать и надоедать светом своих камер. \nА поздравить ОПРСТ с днем возРождения пришли дорогие и милые нам люди... \nЗанимайте места согласно купленным билетам, мы начинаем.','','1','12','123','1','1','1','1428193603','1','1428354088','0','0','0','1428181200','1','','0','0','0','0','0','0','0','1');
