INSERT INTO `oprst_site_content` VALUES ('231','document','text/html','День города - Мариуполь 2013','','','den-goroda-mariupol-2013','http://oprst.com.ua/sobytiya/282-den-goroda-mariupol-2013.html','1','1381480440','0','15','0','Свой юбилей – 235-летие со дня основания – Мариуполь отметил достойно, ярко и почти \"разнообразно\"!\n\nВ этом году праздничное шествие прошло не по районам, как это было на протяжении ряда лет, а было посвящено профессиям! Т.е. вот такой себе парад профессий!\n\nИ начался он после того, как по проспекту прошли воины-интернационалисты, казаки, следом за ними, играя марш, торжественно прошествовал муниципальный духовой оркестр.\n\nОткрыла \"Парад профессий\" колонна металлургов в спецодежде – эта профессия в Мариуполе самая главная. Впереди двигался раскрашенный грузовик с транспарантами.\n\nСмоторите САМЫЙ СУБЪЕКТИВНЫЙ репортаж только на ОПРСТ!\n\nПолную версию парада с Дня города, смотрите тут: http://oprst.com.ua/nashi-prekty/polnaya-versiya/273-den-goroda-mariupol-2013.html','<p style=\"text-align: center;\"><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Приятного просмотра:))</span></p>\n<p style=\"text-align: center;\"></p>','1','12','128','1','1','1','1428220434','3','1428530053','0','0','0','1381480440','3','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('232','document','text/html','Indian night в Бомбее','','','indian-night-v-bombee','http://oprst.com.ua/nashi-prekty/videootchet/280-indian-night-v-bombee.html','1','1384168080','0','15','0','Indian night в боулинг-клубе Бомбей (ПортCity)\n\n«Бомбей» - один из самых масштабных боулинг-клубов страны:\n-16 дорожек;\n-бильярд;\n-современный танцпол. Лучшие ди-джеи Украины!\n-уютная летняя площадка;\n-просторный общий зал;\n-Wi-Fi зона;\n-лаунж-музыка в \"живом\" исполнении;\n-VIP-зона. Здесь Вы сможете отдохнуть от шума и суеты основного зала в атмосфере неофициальной бизнес-встречи.\n\n«Бомбей» - это качественный отдых и атмосфера постоянного праздника. Это идеальный боулинг-клуб для всех, независимо от возраста и рода занятий. \n','<div style=\"text-align: center;\"><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></div>\n<div style=\"text-align: center;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Приятного просмотра:))</span></div>\n<p style=\"text-align: center;\"><span>&nbsp;</span></p>','1','12','129','1','1','1','1428220732','1','1428255227','1','1428440492','3','1384168080','1','','0','0','0','0','0','0','0','1');
