INSERT INTO `oprst_site_content` VALUES ('254','document','text/html','Метаморфозы 8 выпуск','','','metamorfozy-8-vypusk','http://oprst.com.ua/ne-nashe/238-metamorfozy-8-vypusk.html','1','1376388360','0','15','0','Наша новая героиня - Елена, в жизни которой произошли самые главные Метаморфозы - она стала мамой. Но, как и любой молодой мамочки, у нашей героини Лены совсем не остаётся времени на себя. Всё своё свободное время она посвящает маленькой доченьке Софии. И сегодня в новом выпуске проекта Метаморфозы мы покажем вам все секреты перевоплощения Елены из молодлй мамы в красавицу модель.\n  \nДля всех, кто верит в чудеса и наслаждается жизнью, мы с радостью рассказываем новую историю о том, как с легкостью можно изменить себя и свою жизнь, ну, а если вы также хотите принять участие в нашем проекте и стать его героем, пишите на наш адрес olia2d@mail.ru, в письме укажите фамилию, имя и отчество, возраст, контактную информацию и приложите ваше фото.','<p style=\"text-align: center;\"><span style=\"color: #888888;\">Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span style=\"color: #888888;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Приятного просмотра:))</span></p>','1','12','144','1','1','1','1428228612','3','1428530031','0','0','0','1376388360','3','','0','0','0','0','0','0','0','1');
