INSERT INTO `oprst_site_content` VALUES ('261','document','text/html','Метаморфозы - 7','','','metamorfozy-7','http://oprst.com.ua/main/225-metamorfozy-7.html','1','1373971800','0','15','0','В самый разгар лета, авторы и создатели эксклюзивного видео проекта «Метаморфозы» представляют вам новую историю перевоплощения. Солнечное настроение, летние мотивы и теплый воздух вдохновили на новую историю, ну, а наша новая героиня как нельзя лучше воплотила все задумки наших неподражаемых мастеров.\nДля всех, кто верит в чудеса и наслаждается жизнью, мы с радостью рассказываем новую историю о том, как с легкостью можно изменить себя и свою жизнь, ну, а если вы также хотите принять участие в проекте \"Метаморфозы\" и стать его героем, пишите на наш адрес olia2d@mail.ru, в письме укажите фамилию, имя и отчество, возраст, контактную информацию и приложите ваше фото.','<p style=\"text-align: center;\"><span style=\"color: #888888;\">Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span style=\"color: #888888;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Приятного просмотра:))</span></p>','1','12','151','1','1','1','1428231110','3','1428530001','0','0','0','1373971800','3','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('262','document','text/html','AQUA SUMMER FEST 18+','','','aqua-summer-fest-18','http://oprst.com.ua/nashi-prekty/videootchet/222-aqua-summer-fest-18.html','1','1372848900','0','15','0','Для Всех тех, кто отдыхал 28 и 29 числа в \"Курортном Романе\" на фестивале \"Aqua summer fest - 2013\"... и для всех тех, кто хочет очередной раз хочет убедиться, какую же мощную вечеринку он пропустил - для Вас \"контрольный в голову\" видео-репортаж с фестиваля! Приятного просмотра!','<p style=\"text-align: center;\"><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Приятного просмотра:))</span></p>','1','12','152','1','1','1','1428231356','1','1428255437','1','1428440687','3','1372848900','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('263','document','text/html','Аукцион женихов','','','aukcion-zhenihov','http://oprst.com.ua/sobytiya/219-aukcion-zhenihov.html','1','1372762680','0','15','0','В ресторане \"Гуси-Лебеди\" состоялся \"Аукцион женихов\". К участию были приглашены холостяки, свободные от обязательств перед третьими лицами (не женатые, не живущие в гражданском браке, и не имеющие \"прочих обязательств\" перед девушками/женщинами), мужчины, достигшие 18-летнего возраста, заполнившие анкету-заявку, прошедшие \"отборочный тур\", который подразумевает под собой отбор анкет, наиболее подходящих кандидатур для данного мероприятия. ','<p style=\"text-align: center;\"><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Приятного просмотра:))</span></p>','1','12','153','1','1','1','1428231525','1','1428231525','1','1428440692','3','1372762680','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('264','document','text/html','Чемпионат по пейнтболу','','','chempionat-po-pejntbolu','http://oprst.com.ua/sobytiya/218-chempionat-po-peyntbolu.html','1','1372762860','0','15','0','С 10 по 15 мая в центере отдыха и спорта \"Аляска центр\" пройдет первый в истории чемпионат города по любительскому пейнтболу.\n\nДля тех, кто не знает:  Пейнтбол (англ. Paintball — шар с краской) —командная игра с применением ручного пневматического оружия (называемого маркерами), стреляющего капсулами с краской, разбивающимися при ударе о препятствие и окрашивающими его. \nОрганизаторами маневров выступили компания TRINITY и центр спорта и отдыха «Аляска».\nРегламент мероприятия:\nМесто маневров – полигон на спуске «Аляска центр» по ул. Гранитной.\nКоличество команд участников ограничено до 24-х. Торопитесь с регистрацией! 24 команды будут разбиты на 8-мь групп: A; B; C; D; I; F; G; H. Внутри которых команды сыграют между собой по кругу пока не определиться победитель.  \nПобедитель каждой группы, далее, согласно олимпийской системе (на вылет), борется за выход в полуфинал, а затем в финал.\n\nПервые три занятых места являются призовыми. Команды не победившие в турнире – получат море адреналина и немеренно позитивных эмоций.','<p style=\"text-align: center;\"><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp; &nbsp; </span></p>\n<p style=\"text-align: center;\"><span>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Приятного просмотра:))</span></p>','1','12','154','1','1','1','1428231629','1','1428231629','1','1428440696','3','1372762860','1','','0','0','0','0','0','0','0','1');
