INSERT INTO `oprst_site_content` VALUES ('267','document','text/html','Знай наших! Битва DJ-еев','','','znaj-nashih-bitva-dj-eev','http://oprst.com.ua/sobytiya/211-znay-nashih-bitva-dj-eev.html','1','1372246800','0','15','0','В преддверии праздников - 21 июня, в Мариуполе состоялась грандиозная Битва ди-джеев под громким лозунгом \"ЗНАЙ НАШИХ\".\nКомпетентное жюри, состоящее из арт-директоров и учредителей клубов города, выбирало пять лучших работ, мариупольских диск-жокеев. И вот в пятницу состоялся финал пятёрки за звание лучшего!\nКак всё происходило... смотрите видео-отчёт только на канале ОПРСТ! Приятного просмотра!','<p style=\"text-align: center;\"><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Приятного просмотра:))</span></p>','1','12','157','1','1','1','1428234161','1','1428255463','1','1428440706','3','1372246800','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('268','document','text/html','Мисс и мистер университет','','','miss-i-mister-universitet','http://oprst.com.ua/sobytiya/206-miss-i-mister-universitet.html','1','1371901560','0','15','0','20 мая в Драматическом театре прошёл грандиозный конкурс красоты «Студенческая красавица и Мистер университет - 2013». Организаторами конкурса выступили профком и Студенческий сенат Приазовского государственного университета совместно с «Театром моды «Магия».\n Участниками конкурса стали 12 студенток и 6 студентов высших учебных заведений не только Мариуполя, но и всей Украины. Были также гости из зарубежья: студентка из России и иностранные студенты ПГТУ.\n Конкурс красоты проходил в несколько этапов. Традиционно, начали с «Визитной карточки» в ходе которой девушки и парни представились зрителям. Далее, участникам предстояло продемонстрировать свою смекалку и сообразительность в интеллектуальном конкурсе.\n Особенно запомнилось зрителям оригинальное дефиле участников в купальниках. Конкурсантки и конкурсанты демонстрировали лишь силуэты своей фигуры за белой тканью в свете лучей прожекторов.\n Оценивало красоту участников и умение себя преподнести авторитетное жюри в составе представителей университетов города, городского совета, а также спонсоров, под председательством проректора ПГТУ Александра Чейляха,\n В результате, звание «Студенческая красавица» получила 21-летняя студентка экономико-правового факультета МГУ Анастасия Горлакова. А титул «Мистер Университет» получил представитель Марокко и студент ПГТУ Адиль Эль Хомси.\n Зрители же отдали своё предпочтение Екатерине Торчило и Даниилу Анисимову, удостоив ребят званием «Мисс и Мистера зрительских симпатий».','<p style=\"text-align: center;\"><span style=\"color: #888888;\">Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span style=\"color: #888888;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Приятного просмотра:))</span></p>','1','12','158','1','1','1','1428234479','3','1428529862','0','0','0','1371901560','3','','0','0','0','0','0','0','0','1');
