INSERT INTO `oprst_site_content` VALUES ('288','document','text/html','Мисс Coral 2013','','','miss-coral-2013','http://oprst.com.ua/sobytiya/162-miss-coral-2013.html','1','1367238840','0','15','0','19 апреля в РК «Коралл» прошел финал конкурса «Мисс Коралл» 2013. В конкурсе участвовало десять девушек, которые демонстрировали свою красоту и таланты в четырех этапах конкурса: выход в костюмах стюардесс и полицейских, выход в нижнем белье и выходы в коктейльных и вечерних платьях. Титул «Мисс Коралл» получила Елена Себба, первой вице-мисс стала Валентина Шуренко, титул второй вице-мисс завоевала Елена Чебанова, а третьей вице-мисс стала Оксана Нардекова. Подробный фотоотчет смотрите здесь.','','1','12','174','1','1','1','1428237246','1','1428237246','1','1428440776','3','1367238840','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('289','document','text/html','Рождество в Мариуполе','','','rozhdestvo-v-mariupole','http://oprst.com.ua/sobytiya/157-rozhdestvo-v-mariupole.html','1','1366806900','0','15','0','17 апреля в ДК «Металлургов» прошел концерт группы «Рождество». Группа приехала в Мариуполь с концертной программой «Ты знаешь, так хочется жить».\n\nНапомним, что группа образовалась в 2007 году и выпустила свой первый альбом «Один из Вас» и с тех пор пользуется большой популярностью у слушателей.\n\nОткуда такое название \"Рождество\"? Как их занесло в Мариуполь и к какому стилю и направлению музыки относят себя участники этой группы? Смотрите в видео, предоставленном каналом ОПРСТ.','<p style=\"text-align: center;\"><span>Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Приятного просмотра:))</span></p>','1','12','175','1','1','1','1428237284','1','1428255974','1','1428440787','3','1366806900','1','','0','0','0','0','0','0','0','1');
