INSERT INTO `oprst_site_content` VALUES ('384','document','text/html','Vance Joy – Riptide (cover by Daria Bezugla and Victoria West)','','','vance-joy-riptide-cover-by-daria-bezugla-and-victoria-west','','1','0','0','15','0','Очередное проявление талантов мариупольских студентов. Симпатичные девушки, приятные голоса, позитивное настроение, проспект Ленина и шум ветра в микрофоне - все это лицезрим в видео-клипе со сложным и непонятным названием.','','1','12','235','1','1','3','1436983782','3','1436983975','0','0','0','1436983782','3','','0','0','0','0','0','0','0','1');
