INSERT INTO `oprst_site_content` VALUES ('389','document','text/html','Старый маяк привез сталевара','','','staryj-mayak-privez-stalevara','','1','0','0','15','0','Если тебя встречает памятник сталевару - значит ты отдыхаешь в \"Старом маяке\". А если ты проснулся, а сталевар все ещё стоит, значит ты уснул на въезде в Мариуполь!\nНовая шоу-программа, новые эмоции и халявное шампанское... всё это и не только в нашем репортаже. Смотрим и комментируем.','<p style=\"text-align: center;\"><span style=\"color: #c0c0c0;\">Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span style=\"color: #c0c0c0;\">Приятного просмотра &nbsp;))</span></p>','1','12','238','1','1','1','1437920004','1','1437920004','0','0','0','1437920004','1','','0','0','0','0','0','0','0','1');
