INSERT INTO `oprst_site_content` VALUES ('391','document','text/html','День Металлургов. Фотоотчет из кафе Старый маяк.','','','den-metallurgov.-fotootchet-iz-kafe-staryj-mayak','','1','0','0','14','0','Фотоотчет с вечеринки в честь дня Металлургов от нашего фотографа Николая Гусарова. \nВсе кто засветился в кафе Старый маяк - отмечаем себя, репостим и комментируем...\nВсе остальные - завидуем, репостим и комментируем...\nКомментировать можно под видео, репостить здесь http://vk.com/oprstcomua?z=photo-42078971_374706167%2Falbum-42078971_219079997%2Frev ','','1','16','46','1','1','3','1438024269','3','1438024269','0','0','0','1438024269','3','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('392','document','text/html','Мечтательные мариупольцы','','','frau-anna-i-mechtatelnye-mariupolcy','','1','0','0','15','0','До этого, толкать долгую речь и при этом ничего толком не сказать - могла только Киевская мэрия... Но теперь в Мариуполе появился и свой уникальный спикер!\nКак продавать металл, где отдыхать и почему не многим стоит смотреть в завтрашний день - смотрите только в репортаже ОПРСТ!','<p style=\"text-align: center;\"><span style=\"color: #c0c0c0;\">Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span style=\"color: #c0c0c0;\">Приятного просмотра &nbsp;))</span></p>','1','12','240','1','1','1','1438161893','1','1438415011','0','0','0','1438161893','1','','0','0','0','0','0','0','0','1');
