INSERT INTO `oprst_site_content` VALUES ('394','document','text/html','МОХИТО, Урзуф 2015','','','mohito-urzuf-2015','','1','0','0','15','0','На этой неделе канал ОПРСТ задался вопросом: \"Куда подевались все самые соблазнительные девушки Мариуполя?\"\nИ на поиски красавиц мы рванули на побережье Азовского моря. \nИ в этих поисках занесло нас в клуб-бар \"МОХИТО\", а что было дальше... смотрите в видео!','<p style=\"text-align: center;\"><span style=\"color: #c0c0c0;\">Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span style=\"color: #c0c0c0;\">Приятного просмотра &nbsp;))</span></p>','1','12','242','1','1','1','1438727360','3','1439637626','0','0','0','1438727360','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('395','document','text/html','Mojito, девочки, коктейль...','','','mojito-devochki-koktejl','','1','0','0','14','0','Долгожданные фотографии с жаркого побережья Азовского моря. Девочки, девочки, снова девочки.... какой-то мальчик.... выпивка, бармен и безудержное веселье - такой коктейль предложили нам в Mojito.\nИщи себя для аватарки, комментируй чужие фотки здесь ','','1','16','47','1','1','3','1438804046','3','1438804046','0','0','0','1438804046','3','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('396','document','text/html','Отдых УРЗУФ 2015, клуб Aurora ','','','otdyh-urzuf-2015-klub-aurora','','1','0','0','15','0','ДРУЗЬЯ, до осени осталось всего 25 дней!\nСПЕШИТЕ накопить побольше ярких впечатлений лета 2015.\nУрзуф и клуб-бар Аврора ждет вас. Лучшая пенная дискотека побережья, лучшая музыка и лучшая шоу-программа. Проверено ОПРСТ!','<p style=\"text-align: center;\"><span style=\"color: #c0c0c0;\">Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span style=\"color: #c0c0c0;\">Приятного просмотра &nbsp;))</span></p>','1','12','243','1','1','1','1438813169','1','1438813169','0','0','0','1438813169','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('397','document','text/html','Aurora с утренней зарей в морскую превратилась пену....','','','avrora-s-utrennej-zarej-v-morskuyu-prevratilas-penu','','1','0','0','14','0','А если откинуть излишнюю литературность, то мы оторвались давеча по полной в диско-баре Aurora, что будоражит побережье Урзуфа дивной музыкой, медовыми напитками да пипец ярким светом.\n\nПамятные фото узри здесь http://vk.com/album-42078971_219528701\n\nИ здесь очаруй своим красноречием http://vk.com/album-42078971_219528701 ','','1','16','48','1','1','3','1438888346','3','1438888768','0','0','0','1438888346','3','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('398','document','text/html','Бар Mojito при свете солнца','','','bar-mojito-pri-svete-solnca','','1','1438932600','0','14','0','Вашему вниманию продолжение серии фотоотчетов с побережья Урзуфа. Отдых под жарким солнцем с ледяным коктейлем в руках - это трудно описать словами. Поэтому мы попробуем описать фотографиями.\n\nФотоотчёт от фотографа канала ОПРСТ Ярослава Бурлаченко.\n\nКомментируем здесь http://vk.com/album-42078971_219533145 ','','1','16','49','1','1','3','1438894280','3','1438894577','0','0','0','1438932715','0','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('399','document','text/html','Осенний набор открыт!','','','osennij-nabor-otkryt','','1','0','0','15','0','','<p style=\"text-align: center;\"><span style=\"color: #333333;\"><strong>Академия ШАГ объявляет осенний набор на стационар и полустационар по трем специальностям:</strong></span></p>\n<p style=\"text-align: center;\"><span style=\"color: #333333;\">&bull;&nbsp;<a href=\"http://mariupol.itstep.org/design/\"><span style=\"color: #333333;\">Компьютерная графика и дизайн</span></a></span><br><span style=\"color: #333333;\">&bull;&nbsp;<a href=\"http://mariupol.itstep.org/programmirovanie/\"><span style=\"color: #333333;\">Разработка программного обеспечения</span></a></span><br><span style=\"color: #333333;\">&bull;&nbsp;<a href=\"http://mariupol.itstep.org/systemnoe-administrirovanie/\"><span style=\"color: #333333;\">Сетевые технологии и сетевое администрирование</span></a></span></p>\n<p style=\"text-align: center;\"><span style=\"color: #333333;\">&nbsp;<strong>Мы гарантируем высокий уровень образования, только практические и актуальные знания.</strong></span></p>\n<p style=\"text-align: center;\"><span style=\"color: #333333;\"><strong>ГАРАНТИРОВАННОЕ ТРУДОУСТРОЙСТВО</strong>&nbsp;или вернём всю сумму за обучение! БЕЗ ЗНО!</span></p>\n<p style=\"text-align: center;\"><span style=\"color: #333333;\">Мы делаем все, чтобы учиться у нас было интересно и эффективно. У нас нет ничего лишнего &mdash; только то, что нужно для успешного трудоустройства.</span></p>','1','12','244','1','1','1','1439234973','1','1439234973','0','0','0','1439234973','1','','0','0','0','0','0','0','0','1');
