INSERT INTO `oprst_site_content` VALUES ('404','document','text/html','Как зажигали \"Курицы Мариуполя\"? ','','','kak-zazhigali-kuricy-mariupolya-vecherinka-skandalnogo-pablika','','1','0','0','15','0','Вот и прошла одна из самых скандальных вечеринок года \"Курицы Мариуполя\"! \nСпасибо клубу Эгоист за отличное настроение и музыку... Ну а как все прошло, смотрим в репортаже! ))    \"ВЫВЕДЕМ ВСЕХ НА ЧИСТУЮ ВОДУ\" (с)','<p style=\"text-align: center;\"><span style=\"color: #c0c0c0;\">Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span style=\"color: #c0c0c0;\">Приятного просмотра &nbsp;))</span></p>','1','12','247','1','1','1','1440010431','1','1440408193','0','0','0','1440010431','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('407','document','text/html','Вело-драйв и праздничные дни Мариуполя ','','','velo-drajv-i-prazdnichnye-dni-mariupolya','','1','0','0','15','0','Вело-драйв и праздничные дни Мариуполя.\nПарк Гурова, Мариуполь 2015.','<p style=\"text-align: center;\"><span style=\"color: #999999;\">Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span style=\"color: #999999;\">&nbsp;Приятного просмотра ))</span></p>','1','12','250','1','1','1','1440509406','1','1440509406','0','0','0','1440509406','1','','0','0','0','0','0','0','0','1');
