INSERT INTO `oprst_site_content` VALUES ('406','document','text/html','В ПортCity прощались с летом','','','v-portcity-proshhalis-s-letom','','1','0','0','15','0','\"За круглым столом с детьми!\" \nВ ТРЦ ПортCity прощались с летом!','<p style=\"text-align: center;\"><span style=\"color: #999999;\">Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;</span></p>\n<p style=\"text-align: center;\"><span style=\"color: #999999;\">Приятного просмотра:))</span></p>','1','12','249','1','1','1','1440408171','1','1440408171','0','0','0','1440408171','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('408','document','text/html','День независимости в Мариуполе 2015','','','den-nezavisimosti-v-mariupole-2015','','1','0','0','15','0','Более тысячи горожан Мариуполя, с флагами, повязанными ленточками и Украинской символикой, в национальных костюмах и с венками, собрались на площади возле 1000 мелочей... чтобы посмотреть на выступление звёзд украинской эстрады )))\nНо увы, никто не приехал... Не ТІК (как всем обещали), не ОкеанЕльзи (как все надеялись)... В общем местные дворцы культуры выкручивались, как могли.\nИ все горожане поняли: \"Не приехали звезды... и хрен с ними!\"\nЧто из этого получилось? Смотрите в репортаже от ОПРСТ! ','<p style=\"text-align: center;\"><span style=\"color: #c0c0c0;\">Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;</span></p>\n<p style=\"text-align: center;\"><span style=\"color: #c0c0c0;\">Приятного просмотра ))</span></p>','1','12','251','1','1','1','1440529969','1','1440776456','0','0','0','1440529969','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('409','document','text/html','Прощай, лето-2015!!!','','','proshhaj-leto-2015','','1','0','0','15','0','Вот и подошло к концу лето 2015 - го.\nПора возвращаться на работу и учебу :(\nКаким было это лето? Чем запомнилось мариупольцам? И что нужно успеть сделать за остаток лета?... Вы узнаете из этого ролика. ','<p style=\"text-align: center;\"><span style=\"color: #999999;\">Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp; &nbsp; &nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span style=\"color: #999999;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Приятного просмотра:))</span></p>','1','12','252','1','1','1','1441015347','1','1441015347','0','0','0','1441015347','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('410','document','text/html','Посвящение в студенты ПГТУ 2015','','','posvyashhenie-v-studenty-pgtu-2015','','1','1441056660','0','15','0','30 августа 2015 года отметился тем, что несколько сотен еще весенних школьников были посвящены в студенты Приазовского государственного технического университета. Будем надеяться, что им (первокурсникам) этого \"свячения\" хватит на все пять лет учебы.','<p style=\"text-align: center;\"><span style=\"color: #c0c0c0;\">Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. </span></p>\n<p style=\"text-align: center;\"><span style=\"color: #c0c0c0;\">Приятного просмотра!</span></p>','1','12','254','1','1','1','1441102686','1','1441575092','0','0','0','1441056660','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('411','document','text/html','Посвящение в студенты МГУ - 2015','','','posvyashhenie-v-studenty-mgu-2015','','1','0','0','15','0','Свершилось, в МГУ поступили новенькие, свеженькие студенты. Наш канал решил сформировать свою точку зрения, как происходило посвящение в студенты Мариупольского Государственного Университета, НЕ гуманитарного...','<p style=\"text-align: center;\"><span style=\"color: #999999;\">Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp; &nbsp; &nbsp; &nbsp;</span></p>\n<p style=\"text-align: center;\"><span style=\"color: #999999;\">&nbsp; &nbsp; &nbsp; &nbsp;Приятного просмотра:))</span></p>','1','12','253','1','1','1','1441263376','1','1441575056','0','0','0','1441269826','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('412','document','text/html','Собачка пошла в школу','','','sobachka-poshla-v-shkolu','','1','0','0','15','0','\"Собакам тоже нужно учиться\" -подумал наш четвероногий друг, когда увидел толпу школьников на линейке 1 сентября 2015 года','','1','12','255','1','1','1','1441273640','1','1441273640','0','0','0','1441273640','1','','0','0','0','0','0','0','0','1');
INSERT INTO `oprst_site_content` VALUES ('413','document','text/html','\"TSUNAMI-PARTY\" или Песчанка зажигает. Мариуполь 2015','','','tsunami-party-ili-peschanka-zazhigaet.-mariupol-2015','','1','0','0','15','0','С коктейльным зонтиком торчащим из арбуза, гордо прошагал по пляжу \"Песчанки\" - фестиваль Цунами.\nС помощью ритуального танца в море, отдыхающие попрощались с летом и официально закрыли сезон \"отпусков\" и случайных половых связей ))\nПервый блин, как говорится, комом... но не будем отчаиваться! Надеемся организаторы проведут работу над ошибками и уже следующим летом, на \"Цунами-2\", нас ожидает фестиваль с ночной шоу-программой.','<p style=\"text-align: center;\"><span style=\"color: #c0c0c0;\">Внимание! Активируя кнопку воспроизведения Вы автоматически соглашаетесь с нашим СУБЪЕКТИВНЫМ мнением. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p style=\"text-align: center;\"><span style=\"color: #c0c0c0;\">Приятного просмотра &nbsp;))</span></p>','1','12','256','1','1','1','1441574979','1','1441574979','0','0','0','1441574979','1','','0','0','0','0','0','0','0','1');
