INSERT INTO `oprst_site_htmlsnippets` VALUES ('2','feedback','форма обратной связи','0','4','0','[!eForm? &formid=`feedbackForm` &subject=`Сообщение с сайта` &tpl=`eFeedbackForm` &report=`eFeedbackReport` &gotoid=`[*id*]` &vericode=`1` !] \n\n','0');
INSERT INTO `oprst_site_htmlsnippets` VALUES ('3','eFeedbackForm','eFeedbackForm Шаблон формы обратной связи','0','4','0','<p><span style=\"color:#900;\">[+validationmessage+]</span></p>\n\n<form  class=\"eform\" method=\"post\" action=\"[~[*id*]~]\">\n\n<input type=\"hidden\" name=\"formid\" value=\"feedbackForm\" />\n<input value=\"\" name=\"special\" class=\"special\" type=\"text\" eform=\"Спец:date:0\"  style=\"display:none;\" />\n<p>\n    <input type=\"text\" name=\"name\" id=\"name\" class=\"grid_3\" value=\"\"  eform=\"Имя:string:1\"/>\n    <label for=\"name\">Ваше имя</label>\n</p>\n            \n<p>\n    <input type=\"text\" name=\"email\" id=\"email\" class=\"grid_3\" value=\"\" eform=\"E-mail:email:1\" />\n    <label for=\"email\">Ваш E-mail</label>\n</p>\n            \n<p>\n    <input type=\"text\" name=\"phone\" id=\"subject\" class=\"grid_3\" value=\"\" eform=\"Номер телефона:string:1\"/>\n    <label for=\"subject\">Номер телефона</label>\n</p>\n            \n<p>\n    <textarea name=\"comments\" id=\"message\" class=\"grid_6\" cols=\"50\" rows=\"10\" eform=\"Текст сообщения:string:1\"></textarea>\n</p>\n<p>Введите код с картинки: <br />\n    <input type=\"text\" class=\"ver\" name=\"vericode\" /><img class=\"feed\" src=\"[+verimageurl+]\" alt=\"Введите код\" />\n</p>            \n<p>\n    <input type=\"submit\" name=\"submit\" class=\"subeform grid_2\" value=\"Отправить сообщение\"/>\n </p>\n\n</form>\n\n\n \n\n','0');
INSERT INTO `oprst_site_htmlsnippets` VALUES ('4','eFeedbackReport','eFeedbackReport  шаблон отправки на почту','0','4','0','<p>Прислано человеком, с именем: [+name+] . Подробности ниже:</p>\n<table>\n<tr valign=\"top\"><td>Имя:</td><td>[+name+]</td></tr>\n<tr valign=\"top\"><td>E-mail:</td><td>[+email+]</td></tr>\n<tr valign=\"top\"><td>Номер телефона:</td><td>[+phone+]</td></tr>\n<tr valign=\"top\"><td>Текст сообщения:</td><td>[+comments+]</td></tr>\n</table>\n<p>Можно использовать ссылку для ответа: <a href=\"mailto:[+email+]?subject=RE:[+subject+]\">[+email+]</a></p>\n\n','0');
INSERT INTO `oprst_site_htmlsnippets` VALUES ('5','inc_meta','','0','9','0','<!DOCTYPE html>\n<html>\n    <head>\n	<meta charset=\"[(modx_charset)]\" /> \n	<title>[*titl*]</title>\n	[*noIndex*]\n	<meta name=\"keywords\" content=\"[*keyw*]\" />\n	<meta name=\"description\" content=\"[*desc*]\" />\n	<base href=\"[(site_url)]\"/>\n	<link href=\"[(site_url)]assets/tpl/images/favicon.ico\" type=\"image/x-icon\" rel=\"icon\" />\n	<link href=\"[(site_url)]assets/tpl/images/favicon.ico\" type=\"image/x-icon\" rel=\"shortcut icon\" />\n	<link rel=\"stylesheet\" href=\"[(site_url)]assets/tpl/css/tinycarousel.css\" />\n	<link rel=\"stylesheet\" href=\"[(site_url)]assets/tpl/css/flexslider.css\" />\n	<link rel=\"stylesheet\" href=\"[(site_url)]assets/tpl/css/highslide.css\" />\n	<link href=\"[(site_url)]assets/tpl/css/style.css\" rel=\"stylesheet\" />\n	<!--[if IE]>\n		<script src=\"http://html5shiv.googlecode.com/svn/trunk/html5.js\"></script>\n	<![endif]-->\n    </head>\n    <body>\n		<div class=\"wrapper background2\">','0');
INSERT INTO `oprst_site_htmlsnippets` VALUES ('6','inc_scripts','','0','9','0','<script src=\"[(site_url)]assets/tpl/js/jquery-1.11.2.min.js\"></script>\n<script src=\"[(site_url)]assets/tpl/js/tinycarousel.min.js\"></script>\n<script src=\"[(site_url)]assets/tpl/js/flexslider.js\"></script>\n<script src=\"[(site_url)]assets/tpl/js/highslide.js\"></script>\n<script src=\"[(site_url)]assets/tpl/js/global.js\"></script>\n<script type=\"text/javascript\">\nhs.graphicsDir = \'[(site_url)]assets/tpl/js/graphics/\';     \nhs.transitions = [\'expand\'];                 \nhs.fadeInOut = true;                               \nhs.numberPosition = \'caption\';                \nhs.dimmingOpacity = 0.75;                   \nhs.align = \'center\';                           \n	\n// добавляем блок навигации (стандартный)\nhs.addSlideshow({\n        interval: 5000,                       // интервал смен в милисеках\n        repeat: false,                        // повторять/не повторять\n        useControls: true,                    // использовать ли кнопки навигации?\n        overlayOptions: {\n                opacity: 0.6,                  // прозрачность панели навигации\n                position: \'bottom center\',     // позиция панели навигации\n                hideOnMouseOut: false          // панель спрячется, если убрать курсор мыши со слайда         \n    }\n});\n</script>\n<script>\n	$(window).load(function(){\n	       $(\'.flexslider\').flexslider({\n	           animation: \"slide\",\n	           slideshow: true,\n	           slideshowSpeed: 5000,\n	           directionNav: false,\n	           controlNav: true,\n	           start: function(slider){\n	            $(\'body\').removeClass(\'loading\');\n	           }\n	      });\n	});\n</script>\n<script>\n	$(document).ready(function(){\n	$(\'#carusel\').tinycarousel({\n		\n		duration:1000\n	});\n	});\n</script>\n<script type=\"text/javascript\">\n        $(function()\n        {\n            $(\'#openButton\').on(\'click\', function()\n            {\n                $(\'#slideForm\').slideToggle();\n            });\n        });\n        </script>\n<script>\n	$(function(){\n		$(\"#disqus_thread #dsq-2 #layout\").css(\"border\",\"1px solid red\");\n	});\n</script>','0');
INSERT INTO `oprst_site_htmlsnippets` VALUES ('7','inc_footer','','0','9','0','</div>\n        <footer>\n            <div class=\"clearfix\">\n                <div class=\"left\">\n                    <a class=\"logo\" href=\"[(site_url)]\"><img src=\"[(site_url)]assets/tpl/images/logo.png\" alt=\"ОПРСТ\"></a>\n\n                    <p class=\"copy\">\n                        <span>Интернет канал вашего города</span>\n                        <span>2012 - 2015 (с)</span>\n                    </p>\n                </div>\n\n                <div class=\"right\">\n                    <span>Следишь за нами?</span>\n\n                    <ul class=\"socials reset\">\n						<li><a class=\"vk\" target=\"_blank\" href=\"http://vk.com/oprstcomua\"></a></li>\n                        <li><a class=\"tw\" target=\"_blank\" href=\"https://twitter.com/oprst_com_ua\"></a></li>\n                        <li><a class=\"fb\" target=\"_blank\" href=\"http://www.facebook.com/groups/506884652659015/\"></a></li>\n                        <li><a class=\"gp\" target=\"_blank\" href=\"https://plus.google.com/116192054864537564822/posts\"></a></li>\n                    </ul>\n                </div>\n            </div>\n			{{inc_scripts}}\n        </footer>\n    </body>\n</html>','0');
