INSERT INTO `oprst_site_modules` VALUES ('3','EvoGallery','<strong>1.2 Beta 1</strong> Gallery Management Module','0','0','5','0','0','','0','','0','0','23636a8c613426979b9dea1ff0415abf','1','&docId=Root Document ID;integer;0 &phpthumbImage=PHPThumb config for images in JSON;textarea;{\'w\': 1920, \'h\': 940, \'q\': 95} &phpthumbThumb=PHPThumb config for thumbs in JSON;textarea;{\'w\': 250, \'h\': 250, \'q\': 75} &savePath=Save path;string;assets/galleries &keepOriginal=Keep original images;list;Yes,No;Yes &randomFilenames=Random filenames;list;Yes,No;No','/**\n * EvoGallery\n * Gallery Management Module\n * Written by Brian Stanback and fixed by Dmi3yy\n * jQuery rewrite and updates by Jeff Whitfield <jeff@collabpad.com>\n */\n\n$params[\'modulePath\'] = $modx->config[\'base_path\'].\'assets/modules/evogallery/\';\ninclude_once($params[\'modulePath\'] . \"classes/maketable.class.inc.php\");\ninclude_once($params[\'modulePath\'] . \"classes/management.class.inc.php\");\n\nif (class_exists(\'GalleryManagement\'))\n	$manager = new GalleryManagement($params);\nelse\n	$modx->logEvent(1, 3, \'Error loading Portfolio Galleries management module\');\n\n$manager->checkGalleryTable();\n\necho $manager->execute();\n');
