INSERT INTO `oprst_site_plugins` VALUES ('8','CfgTv','<strong>0.1</strong> Save TV as system setting from some resourse','0','0','0','$e =& $modx->event;\nswitch ($e->name ) {\n    case \'OnBeforeDocFormSave\':\n                $list_id=explode(\',\',$ids);\n                if (!in_array($_POST[\'id\'],$list_id)) return;\n                $SQL=\"SELECT * FROM \".$modx->getFullTableName(\'site_tmplvars\').\";\";\n                $result=$modx->db->query($SQL);\n                        while($row=$modx->db->getRow($result)) {\n        $TVNAME[$row[\'id\']]=$row[\'name\'];\n      }\n                foreach($_POST as $key=>$value){\n                if (substr($key,0,2)!=\'tv\') continue;\n                $id=substr($key,2,strlen($key));\n                $name=$prefix.$TVNAME[$id];\n                $settings[$name]=$value;\n                $SQL=\"SELECT * FROM \".$modx->getFullTableName(\'system_settings\').\" WHERE `setting_name`=\'\".$name.\"\'\";\n                $count=$modx->db->getRow($modx->db->query($SQL));\n        if (!empty($count[\'setting_name\'])){\n                        $SQL=\"UPDATE \".$modx->getFullTableName(\'system_settings\').\" SET `setting_value`=\'\".$value.\"\' WHERE `setting_name`=\'\".$name.\"\'\";\n                $modx->db->query($SQL);\n        } else {\n          $SQL=\"INSERT into \".$modx->getFullTableName(\'system_settings\').\" SET `setting_name`=\'\".$name.\"\',`setting_value`=\'\".$value.\"\'\";\n                $modx->db->query($SQL);\n        }\n                }\n    break ;\n}','0','&ids=ID ресурсов настроек;text;4 &prefix=Префикс;text;cfg_','0',' ');
INSERT INTO `oprst_site_plugins` VALUES ('9','EvoGallery','<strong>1.2 Beta 1</strong> Plugin for delete images on empty trash','0','5','0','if (!isset($params[\'modulePath\'])) $params[\'modulePath\'] = $modx->config[\'base_path\'].\'assets/modules/evogallery/\';\ninclude_once($params[\'modulePath\'] . \"classes/management.class.inc.php\");\nif (class_exists(\'GalleryManagement\'))\n	$manager = new GalleryManagement($params);\nelse\n	$modx->logEvent(1, 3, \'Error loading Portfolio Galleries management module\');\n$e =& $modx->event;\nswitch ($e->name ) {\n    case \'OnEmptyTrash\':\n		$manager->deleteImages(\'contentid\',$ids);\n		break ;\n    default:\n        return ;\n}\n','0','','0','23636a8c613426979b9dea1ff0415abf');
INSERT INTO `oprst_site_plugins` VALUES ('10','Diff','<strong>2.6</strong> plugin for Modx Evo','0','5','0','/*************************************/\nif(file_exists($modx->config[\'base_path\'].\'assets/plugins/\'.$folderPlugin.\'/lang/\'.$modx->config[\'manager_language\'].\'.inc.php\')){\n  include($modx->config[\'base_path\'].\'assets/plugins/\'.$folderPlugin.\'/lang/\'.$modx->config[\'manager_language\'].\'.inc.php\');\n}else{\n  include($modx->config[\'base_path\'].\'assets/plugins/\'.$folderPlugin.\'/lang/english.inc.php\');\n}\ninclude($modx->config[\'base_path\'].\'assets/plugins/\'.$folderPlugin.\'/version.class.php\');\nswitch($modx->Event->name){\n	/** Template */\n	case \'OnTempFormDelete\':{\n		$Diff=new ElementVer($modx,\'template\',$folderPlugin);\n		if($Diff->ignored($ignoredTPL)){\n			$Diff->del($modx->Event->params[\'id\']);\n		}\n		break;\n	}\n	case \'OnTempFormSave\':{\n		$Diff=new ElementVer($modx,\'template\',$folderPlugin);\n		if($Diff->ignored($ignoredTPL)){\n			$Diff->countVer=(int)$countTPL;\n			$Diff->save($modx->Event->params[\'id\'],\'post\');\n		}\n		break;\n	}\n	case \'OnTempFormRender\':{\n		$Diff=new ElementVer($modx,\'template\',$folderPlugin);\n		if($Diff->ignored($ignoredTPL)){\n			$out=$Diff->loadJs($idBlock,$which_jquery,$jqname,$js_src_type);\n			$modx->Event->output($out);\n		}\n		break;\n	}\n	\n	/** Snippet */\n	case \'OnSnipFormDelete\':{\n		$Diff=new ElementVer($modx,\'snippet\',$folderPlugin);\n		if($Diff->ignored($ignoredSnippet)){\n			$Diff->del($modx->Event->params[\'id\']);\n		}\n		break;\n	}\n	case \'OnSnipFormSave\':{\n		$Diff=new ElementVer($modx,\'snippet\',$folderPlugin);\n		if($Diff->ignored($ignoredSnippet)){\n			$Diff->countVer=(int)$countSnippet;\n			$Diff->save($modx->Event->params[\'id\'],\'post\');\n		}\n		break;\n	}\n	case \'OnSnipFormRender\':{\n		$Diff=new ElementVer($modx,\'snippet\',$folderPlugin);\n		if($Diff->ignored($ignoredSnippet)){\n			$out=$Diff->loadJs($idBlock,$which_jquery,$jqname,$js_src_type);\n			$modx->Event->output($out);\n		}\n		break;\n	}\n	\n	/** Plugin */\n	case \'OnPluginFormDelete\':{\n		$Diff=new ElementVer($modx,\'plugin\',$folderPlugin);\n		if($Diff->ignored($ignoredPlugin)){\n			$Diff->del($modx->Event->params[\'id\']);\n		}\n		break;\n	}\n	case \'OnPluginFormSave\':{\n		$Diff=new ElementVer($modx,\'plugin\',$folderPlugin);\n		if($Diff->ignored($ignoredPlugin)){\n			$Diff->countVer=(int)$countPlugin;\n			$Diff->save($modx->Event->params[\'id\'],\'post\');\n		}\n		break;\n	}\n	case \'OnPluginFormRender\':{\n		$Diff=new ElementVer($modx,\'plugin\',$folderPlugin);\n		if($Diff->ignored($ignoredPlugin)){\n			$out=$Diff->loadJs($idBlock,$which_jquery,$jqname,$js_src_type);\n			$modx->Event->output($out);\n		}\n		break;\n	}\n	\n	/** Module */\n	case \'OnModFormDelete\':{\n		$Diff=new ElementVer($modx,\'module\',$folderPlugin);\n		if($Diff->ignored($ignoredModule)){\n			$Diff->del($modx->Event->params[\'id\']);\n		}\n		break;\n	}\n	case \'OnModFormSave\':{\n		$Diff=new ElementVer($modx,\'module\',$folderPlugin);\n		if($Diff->ignored($ignoredModule)){\n			$Diff->countVer=(int)$countModule;\n			$Diff->save($modx->Event->params[\'id\'],\'post\');\n		}\n		break;\n	}\n	case \'OnModFormRender\':{\n		$Diff=new ElementVer($modx,\'module\',$folderPlugin);\n		if($Diff->ignored($ignoredModule)){\n			$out=$Diff->loadJs($idBlock,$which_jquery,$jqname,$js_src_type);\n			$modx->Event->output($out);\n		}\n		break;\n	}\n	\n	/** Chunk */\n	case \'OnChunkFormDelete\':{\n		$Diff=new ElementVer($modx,\'chunk\',$folderPlugin);\n		if($Diff->ignored($ignoredChunk)){\n			$Diff->del($modx->Event->params[\'id\']);\n		}\n		break;\n	}\n	case \'OnChunkFormSave\':{\n		$Diff=new ElementVer($modx,\'chunk\',$folderPlugin);\n		if($Diff->ignored($ignoredChunk)){\n			$Diff->countVer=(int)$countChunk;\n			$Diff->save($modx->Event->params[\'id\'],\'post\');\n		}\n		break;\n	}\n	case \'OnChunkFormRender\':{\n		$Diff=new ElementVer($modx,\'chunk\',$folderPlugin);\n		if($Diff->ignored($ignoredChunk)){\n			$out=$Diff->loadJs($idBlock,$which_jquery,$jqname,$js_src_type);\n			$modx->Event->output($out);\n		}\n		break;\n	}\n	/** Document */\n	case \'OnDocFormDelete\':{\n		$Diff=new ElementVer($modx,\'document\',$folderPlugin);\n		if($Diff->ignored($ignoredDoc)){\n			$Diff->del($modx->Event->params[\'id\']);\n		}\n		break;\n	}\n	case \'OnDocFormSave\':{\n		$Diff=new ElementVer($modx,\'document\',$folderPlugin);\n		if($Diff->ignored($ignoredDoc)){\n			$Diff->countVer=(int)$countDoc;\n			$Diff->save($modx->Event->params[\'id\'],\'ta\');\n		}\n		break;\n	}\n	case \'OnDocFormRender\':{\n		$Diff=new ElementVer($modx,\'document\',$folderPlugin);\n		if($Diff->ignored($ignoredDoc)){\n			// Check for ManagerManager\n			$res = $modx->db->select(\'*\', $modx->getFullTableName(\'site_plugins\'), \'name=\"ManagerManager\" AND disabled=0 \');\n			$mmActive = $modx->db->getRow($res);\n			if (!$mmActive) {\n				$out=$Diff->loadJs($idBlock,$which_jquery,$jqname,$js_src_type);\n			} else {\n				$out=$Diff->loadJs($idBlock,\'not_include\',$jqname,$js_src_type);\n			}\n			$modx->Event->output($out);\n		}\n		break;\n	}\n}\n//?>','0','&idBlock=ID блока;text;Version &folderPlugin=Папка плагина;text;diff &which_jquery=Подключить jQuery;list;Не подключать,/assets/js/,google code,custom url;/assets/js/ &js_src_type=Свой url к библиотеке jQuery;text; &jqname=Имя Jquery переменной в noConflict;text;j &ignoredChunk=ID игнорируемых чанков;text; &ignoredSnippet=ID игнорируемых сниппетов;text; &ignoredPlugin=ID игнорируемых плагинов;text; &ignoredDoc=ID игнорируемых документов;text; &ignoredModule=ID игнорируемых модулей;text; &ignoredTPL=ID игнорируемых шаблонов;text; &countTPL=Кол-во версий одного шаблона;text; &countChunk=Кол-во версий одного чанка;text; &countPlugin=Кол-во версий одного плагина;text; &countModule=Кол-во версий одного модуля;text; &countSnippet=Кол-во версий одного сниппета;text; &countDoc=Кол-во версий одного документа;text;','0','');
INSERT INTO `oprst_site_plugins` VALUES ('11','Search Highlight','<strong>1.5</strong> Used with AjaxSearch to show search terms highlighted on page linked from search results','0','12','0','/*\n  ------------------------------------------------------------------------\n  Plugin: Search_Highlight v1.5\n  ------------------------------------------------------------------------\n  Changes:\n  18/03/10 - Remove possibility of XSS attempts being passed in the URL\n           - look-behind assertion improved\n  29/03/09 - Removed urldecode calls;\n           - Added check for magic quotes - if set, remove slashes\n           - Highlights terms searched for when target is a HTML entity\n  18/07/08 - advSearch parameter and pcre modifier added\n  10/02/08 - Strip_tags added to avoid sql injection and XSS. Use of $_REQUEST\n  01/03/07 - Added fies/updates from forum from users mikkelwe/identity\n  (better highlight replacement, additional div around term/removal message)\n  ------------------------------------------------------------------------\n  Description: When a user clicks on the link from the AjaxSearch results\n    the target page will have the terms highlighted.\n  ------------------------------------------------------------------------\n  Created By:  Susan Ottwell (sottwell@sottwell.com)\n               Kyle Jaebker (kjaebker@muddydogpaws.com)\n\n  Refactored by Coroico (www.evo.wangba.fr) and TS\n  ------------------------------------------------------------------------\n  Based off the the code by Susan Ottwell (www.sottwell.com)\n    http://modxcms.com/forums/index.php/topic,1237.0.html\n  ------------------------------------------------------------------------\n  CSS:\n    The classes used for the highlighting are the same as the AjaxSearch\n  ------------------------------------------------------------------------\n  Notes:\n    To add a link to remove the highlighting and to show the searchterms\n    put the following on your page where you would like this to appear:\n\n      <!--search_terms-->\n\n    Example output for this:\n\n      Search Terms: the, template\n      Remove Highlighting\n\n    Set the following variables to change the text:\n\n      $termText - the text before the search terms\n      $removeText - the text for the remove link\n  ------------------------------------------------------------------------\n*/\nglobal $database_connection_charset;\n// Conversion code name between html page character encoding and Mysql character encoding\n// Some others conversions should be added if needed. Otherwise Page charset = Database charset\n$pageCharset = array(\n  \'utf8\' => \'UTF-8\',\n  \'latin1\' => \'ISO-8859-1\',\n  \'latin2\' => \'ISO-8859-2\'\n);\n\nif (isset($_REQUEST[\'searched\']) && isset($_REQUEST[\'highlight\'])) {\n\n  // Set these to customize the text for the highlighting key\n  // --------------------------------------------------------\n     $termText = \'<div class=\"searchTerms\">Search Terms: \';\n     $removeText = \'Remove Highlighting\';\n  // --------------------------------------------------------\n\n  $highlightText = $termText;\n  $advsearch = \'oneword\';\n\n  $dbCharset = $database_connection_charset;\n  $pgCharset = array_key_exists($dbCharset,$pageCharset) ? $pageCharset[$dbCharset] : $dbCharset;\n\n  // magic quotes check\n  if (get_magic_quotes_gpc()){\n    $searched = strip_tags(stripslashes($_REQUEST[\'searched\']));\n    $highlight = strip_tags(stripslashes($_REQUEST[\'highlight\']));\n    if (isset($_REQUEST[\'advsearch\'])) $advsearch = strip_tags(stripslashes($_REQUEST[\'advsearch\']));\n  }\n  else {\n    $searched = strip_tags($_REQUEST[\'searched\']);\n    $highlight = strip_tags($_REQUEST[\'highlight\']);\n    if (isset($_REQUEST[\'advsearch\'])) $advsearch = strip_tags($_REQUEST[\'advsearch\']);\n  }\n\n  if ($advsearch != \'nowords\') {\n\n    $searchArray = array();\n    if ($advsearch == \'exactphrase\') $searchArray[0] = $searched;\n    else $searchArray = explode(\' \', $searched);\n\n    $searchArray = array_unique($searchArray);\n    $nbterms = count($searchArray);\n    $searchTerms = array();\n    for($i=0;$i<$nbterms;$i++){\n      // Consider all possible combinations\n      $word_ents = array();\n      $word_ents[] = $searchArray[$i];\n      $word_ents[] = htmlentities($searchArray[$i], ENT_NOQUOTES, $pgCharset);\n      $word_ents[] = htmlentities($searchArray[$i], ENT_COMPAT, $pgCharset);\n      $word_ents[] = htmlentities($searchArray[$i], ENT_QUOTES, $pgCharset);\n      // Avoid duplication\n      $word_ents = array_unique($word_ents);\n      foreach($word_ents as $word) $searchTerms[]= array(\'term\' => $word, \'class\' => $i+1);\n    }\n\n    $output = $modx->documentOutput; // get the parsed document\n    $body = explode(\"<body\", $output); // break out the head\n\n    $highlightClass = explode(\' \',$highlight); // break out the highlight classes\n    /* remove possibility of XSS attempts being passed in URL */\n    foreach ($highlightClass as $key => $value) {\n       $highlightClass[$key] = preg_match(\'/[^A-Za-z0-9_-]/ms\', $value) == 1 ? \'\' : $value;\n    }\n\n    $pcreModifier = ($pgCharset == \'UTF-8\') ? \'iu\' : \'i\';\n    $lookBehind = \'/(?<!&|&[\\w#]|&[\\w#]\\w|&[\\w#]\\w\\w|&[\\w#]\\w\\w\\w|&[\\w#]\\w\\w\\w\\w|&[\\w#]\\w\\w\\w\\w\\w)\';  // avoid a match with a html entity\n    $lookAhead = \'(?=[^>]*<)/\'; // avoid a match with a html tag\n\n    $nbterms = count($searchTerms);\n    for($i=0;$i<$nbterms;$i++){\n      $word = $searchTerms[$i][\'term\'];\n      $class = $highlightClass[0].\' \'.$highlightClass[$searchTerms[$i][\'class\']];\n\n      $highlightText .= ($i > 0) ? \', \' : \'\';\n      $highlightText .= \'<span class=\"\'.$class.\'\">\'.$word.\'</span>\';\n\n      $pattern = $lookBehind . preg_quote($word, \'/\') . $lookAhead . $pcreModifier;\n      $replacement = \'<span class=\"\' . $class . \'\">${0}</span>\';\n      $body[1] = preg_replace($pattern, $replacement, $body[1]);\n    }\n\n    $output = implode(\"<body\", $body);\n\n    $removeUrl = $modx->makeUrl($modx->documentIdentifier);\n    $highlightText .= \'<br /><a href=\"\'.$removeUrl.\'\" class=\"ajaxSearch_removeHighlight\">\'.$removeText.\'</a></div>\';\n\n    $output = str_replace(\'<!--search_terms-->\',$highlightText,$output);\n    $modx->documentOutput = $output;\n  }\n}\n','0','','0','');
INSERT INTO `oprst_site_plugins` VALUES ('12','JotAdminNotify','<strong>0.1</strong> На главной странице админки отображается количество неопубликованных коментариев снипета JotX','0','0','0','$output = \"\";\n$e = &$modx->Event;\nif($e->name == \'OnManagerWelcomePrerender\'){\n\n    $table = $modx->getFullTableName(\'jot_content\');\n    $sitecontent = $modx->getFullTableName(\'site_content\');\n    $rs = $modx->db->query(\"SELECT count(jc.uparent) as count, jc.uparent, sc.pagetitle FROM $table jc left join $sitecontent sc on sc.id = uparent where jc.published=0 group by jc.uparent\");\n    while($row=$modx->db->GetRow($rs)){\n        if ($row[\'count\']>0){\n            $id = $row[\'uparent\'];\n            $count = $row[\'count\'];\n            $url = $modx->makeUrl($id);\n            $output .= \"<li><a href=\'$url\' target=\'_blank\'>\".$row[\'pagetitle\'].\": $count</a></li>\";\n        }\n    }\n    \n    if (!empty($output)){\n        $output = \'<div class=\"sectionHeader\" style=\"color:red\">Имеются неопубликованные комментарии</div><div class=\"sectionBody\"><ul>\'.$output.\'</ul></div>\';\n    }\n    $e->output($output);\n}\n','0','','1','');
INSERT INTO `oprst_site_plugins` VALUES ('13','Clear Comments','<strong>1.0</strong> Remove comments of documents when you empty MODx Trash Can.','0','0','0','/**\n * Clear Comments Plugin: Remove comments of documents when you empty MODx Trash Can.\n * Version: 1.0\n * Event: \"OnEmptyTrash\"\n * Requirement: Jot Snippet\n * Work on: Evolution\n *\n * Author: AHHP ~ Boplo.ir\n * Date: 21 August 2009\n*/\n\ndefined(\'IN_MANAGER_MODE\') or die();\nif($modx->Event->name == \"OnEmptyTrash\")\n{\n	$where = \'uparent IN(\' .join(\',\' , $ids). \')\';\n	$jot_content = $modx->getFullTableName(\'jot_content\');\n	$jot_fields = $modx->getFullTableName(\'jot_fields\');\n	$jot_subscriptions = $modx->getFullTableName(\'jot_subscriptions\');\n	\n	\n	// If `jot_fields` exists\n	if($modx->db->getRecordCount( $modx->db->query(\"SHOW TABLES LIKE \'$jot_fields\'\") ) == 1)\n	{\n		// `jot_fields` stores fields by comments ID so we need to get comments ID that are removing.\n		$commentsIds = array();\n		$select = $modx->db->select(\"id\", $jot_content, $where);\n		while($commentRow = $modx->db->getRow($select, \'num\'))\n			$commentsIds[] = $commentRow[0];\n		\n		if(count($commentsIds) > 0)\n			$modx->db->delete($jot_fields, \'id IN(\' .join(\",\",$commentsIds). \')\');\n		\n		unset($select, $commentsIds);\n	}\n	\n	$modx->db->delete($jot_content, $where);\n	$modx->db->delete($jot_subscriptions, $where);\n}','0','','1','');
