INSERT INTO `oprst_site_templates` VALUES ('12','Видео-ролик','','0','0','','0','{{inc_meta}}\n{{inc_header}}\n<div class=\"center content video_page\">\n                <section>\n				<h1 class=\"bigtitle\">\n                        <span>[*pagetitle*]</span>\n                    </h1>\n					[!countViews? &type=`counter` &id=`[*id*]` &tvid=`15`!]\n					<div class=\"row intro\">[*introtext*]</div>\n                    <div class=\"row rolik\">\n						[!prevnextPage?  &folderId=`15` &prevClass=`prev_video` &nextClass=`next_video` &sortBy=`pub_date` &sortDir=`DESC` &letsCycle=`1`!]\n						[+pnp_prev+]\n						<div class=\"iframes\">[*video*]</div>\n						[+pnp_next+]\n                    </div>\n					\n                    <div class=\"row\">\n                        <article>\n                            [*content*]\n                        </article>\n						<div class=\"social\">\n						<script type=\"text/javascript\">(function() {\n  if (window.pluso)if (typeof window.pluso.start == \"function\") return;\n  if (window.ifpluso==undefined) { window.ifpluso = 1;\n    var d = document, s = d.createElement(\'script\'), g = \'getElementsByTagName\';\n    s.type = \'text/javascript\'; s.charset=\'UTF-8\'; s.async = true;\n    s.src = (\'https:\' == window.location.protocol ? \'https\' : \'http\')  + \'://share.pluso.ru/pluso-like.js\';\n    var h=d[g](\'body\')[0];\n    h.appendChild(s);\n  }})();</script>\n<div class=\"pluso\" data-background=\"#ebebeb\" data-options=\"medium,square,line,horizontal,counter,theme=04\" data-services=\"vkontakte,odnoklassniki,facebook,twitter,google,moimir,email\"></div>\n						</div>\n                    </div>\n					[!if? &is=`[*id*]:is:361` &then=`\n						[!EasyPoll? &pollid=`3` &lang=`ru` &easylang=`ru`!]\n					`!]\n					[!if? &is=`[*id*]:is:362` &then=`\n						[!EasyPoll? &pollid=`3` &lang=`ru` &easylang=`ru`!]\n					`!]\n					<div id=\"comments\">\n						[!JotX? &config=`tree-ajax` &moderated=`1` &tplForm=`comment_form` !]\n					</div>\n                </section>\n            </div>\n{{inc_footer}}','0');
