INSERT INTO `oprst_site_templates` VALUES ('19','Реклама','','0','0','','0','{{inc_meta}}\n{{inc_header}}\n<div class=\"center content home reklama_page\" style=\"margin-top: 4px;\">\n	<div class=\"bigtitle\"><span>Реклама</span></div>\n	<p class=\"text\">\n		Можно смело сказать без лишней скромности, что ОПРСТ - это офигенный и чётенький медиа-портал. Единственный и неповторимый! Здесь вы сможете найти БУКВАЛЬНО всё и в самой оригинальной подаче: городские новости, обзор общественных мест, дебильные интервью и даже где спрятался Березовский!\nМы каждый день принимаем на свои страницы  более 10 000 посещений, а наши ролики транслируются на десятках сайтов партнёров и телеканалах областного и всеукраинского вещания.\n	</p>\n	<h2>На кой мы сдались?</h2>\n	<p class=\"pod-h2\">Вам однозначно дорога к нам, если:</p>\n	<div class=\"reklama_items\">\n		<div class=\"item item-1\">\n			Вам предстоит важное событие: свадьба, день рождения или развод и вы хотите качественный фото и видео отчеты\n		</div>\n		<div class=\"item item-2\">\n			Вы хотите снять профессиональное видео, клип, рекламный ролик\n		</div>\n		<div class=\"item item-3\">\n			У вас есть готовые видео, фото материалы, и вы хотите предать их максимальной огласке\n		</div>\n		<div class=\"item item-4\">\n			Хотите получить хороший выхлоп от рекламы, но не знаете, куда хлопать\n		</div>\n	</div>\n	<p class=\"go-oprst\">В общем по любому поводу… идите Вы в ОПРСТ!</p>\n	<h2>Примеры наших видео работ</h2>\n	<div class=\"primers\">\n		<div class=\"title\">\n			Репортажи\n			<div class=\"prices\">от <span>[*price_reportag*]</span> грн.<p>с размещением</p></div>\n		</div>\n		<div class=\"roliks\">\n			[[Ditto? &tpl=`video_reklama.item` &parents=`15` &dateFormat=`%d.%m.%Y` &dateSource=`pub_date` &sortBy=`pub_date` &sortDir=`DESC` &display=`3` &noResults=`` &filter=`show_reportag,1,1` &paginate=`0`]]	\n		</div>\n	</div>\n	<div class=\"primers\">\n		<div class=\"title\">\n			Реклама\n			<div class=\"prices\">от <span>[*price_reklama*]</span> грн.<p>с размещением и ротацией на ТВ</p></div>\n		</div>\n		<div class=\"roliks\">\n			[[Ditto? &tpl=`video_reklama.item` &parents=`15` &dateFormat=`%d.%m.%Y` &dateSource=`pub_date` &sortBy=`pub_date` &sortDir=`DESC` &display=`3` &noResults=`` &filter=`show_reklama,1,1` &paginate=`0`]]	\n		</div>\n	</div>\n	<div class=\"primers\">\n		<div class=\"title\">\n			Передачи\n			<div class=\"prices\">от <span>[*price_peredach*]</span> грн.<p>с размещением и ротацией на ТВ</p></div>\n		</div>\n		<div class=\"roliks\">\n			[[Ditto? &tpl=`video_reklama.item` &parents=`15` &dateFormat=`%d.%m.%Y` &dateSource=`pub_date` &sortBy=`pub_date` &sortDir=`DESC` &display=`3` &noResults=`` &filter=`show_peredach,1,1` &paginate=`0`]]	\n		</div>\n	</div>\n	<div class=\"reklama_other\">\n		<div class=\"primers\">\n		<div class=\"title\">\n			СВАДЬБА  (2-х камерная съемка в формате HD)\n			<div class=\"prices price2\">от <span>[*price_wedding*]</span> грн.</div>\n		</div>\n		</div>\n		\n		<div class=\"primers\">\n		<div class=\"title\">\n			День рождения (2-х камерная съемка в формате HD)\n			<div class=\"prices price2\">от <span>[*price_happy*]</span> грн.</div>\n		</div>\n		</div>\n		\n		<div class=\"primers\">\n		<div class=\"title\">\n			Видео поздравления \n			<div class=\"prices price2\">от <span>[*price_pozdrav*]</span> грн.</div>\n		</div>\n		</div>\n		\n		<div class=\"primers\">\n		<div class=\"title\">\n			LoveStory (2-х камерная съемка в формате HD)\n			<div class=\"prices price2\">от <span>[*price_love*]</span> грн.</div>\n		</div>\n		</div>\n		<p class=\"pink\">\n			Дополнительные услуги: Признание в любви на большом экране в кинотеатре, прорисовка инфо-графики, видео-презентации, 3Д анимация и т.д. (Цена договорная)\n		</p>\n		<div class=\"roliks\" style=\"padding:0 36px;\">\n			[[Ditto? &tpl=`video_reklama.item` &parents=`15` &dateFormat=`%d.%m.%Y` &dateSource=`pub_date` &sortBy=`pub_date` &sortDir=`DESC` &display=`3` &noResults=`` &filter=`show_dopus,1,1` &paginate=`0`]]	\n		</div>\n	</div>\n	<h2>Примеры наших фото работ</h2>\n	<div class=\"primers\">\n		<div class=\"title\">\n			Фотосъемка\n			<div class=\"prices\">от <span>[*price_photo*]</span> грн.<p>с размещением</p></div>\n		</div>\n		<div class=\"roliks-photo\">\n			[!EvoGallery? &docId=`83` &display=`images` &itemTpl=`photo_other_item.item`!]\n		</div>\n	</div>\n	<p class=\"primer-photo-text\">\n		Дорогие друзья, если вы хотите поднять продажи, увеличить доходы, повысить медийность и популярность компании, дать второе дыхание бизнесу,  распиарить группу или даже себя лично, то обязательно  обратитесь к менеджерам канала ОПРСТ здесь. Ради Вас, команда профессионалов сделает всё возможное и не только. Ведь не даром, канал ОПРСТ входит в 3-ку самых публичных медиа-площадок области!\n	</p>\n	<h2 style=\"margin-bottom:15px;\">Мы гарантируем</h2>\n	<h4 class=\"garant\">Качество съемки</h4>\n	<h4 class=\"garant\">Максимальную ротацию вашему медиа-продукту</h4>\n	<h4 class=\"garant\">Поднятие имиджа и максимальную рекламную отдачу!</h4>\n	<div class=\"reklama_other\">\n		<p>Мы всегда предоставим эксклюзивные условия!</p>\n		<a href=\"#\" class=\"bouttonYellow download\">Скачать</a>\n	</div>\n	<div class=\"other-text\">\n		[*content*]\n	</div>\n	<div class=\"reklama-citate\">\n		Мы и НЕ надеемся, что Вам будет интересно сотрудничать с нами, мы в этом УВЕРЕНЫ! <br>\n		Приятного времяпровождения на наших «уматовых» страницах! ))\n	</div>\n</div>\n{{inc_footer}}','0');
