INSERT INTO `oprst_site_templates` VALUES ('26','Видео бурса','','0','0','','0','{{inc_meta}}\n{{inc_header}}\n<div class=\"center content home\" style=\"margin-top: 4px;position:relative;\">\n                <div class=\"row clearfix\">\n                    <div class=\"bigtitle\"><span>Видео-бурса</span></div>\n                </div>\n\n                <div class=\"article_video\" style=\"margin-right: 240px;\">\n                    [*content*]\n\n					<!--\n                    <p class=\"article_video\" style=\"width: 290px;\">\n                       [*introtext*]\n                    </p>\n					-->\n                </div>\n\n                <div class=\"price bursaPrice\">\n                    <span class=\"priceHeader\">Акционная цена</span>\n                    <span class=\"priceCur\">[*price*] <span>грн</span></span>\n                    <span class=\"pricePrev\"><s>[*old_price*] грн</s></span>\n                </div>\n\n				<!--	\n                <div class=\"imageCollection\" style=\"margin-top: 38px; margin-left: 12px;\">\n                    <a class=\"photo\" href=\"\">\n                        <img src=\"assets/tpl/images/photos-2.png\" alt=\"Мастер Шеф\">\n                        <p>Мастер Шеф</p>\n                    </a>\n\n                    <a class=\"photo\" href=\"\">\n                        <img src=\"assets/tpl/images/photos-3.png\" alt=\"Мастер Шеф\">\n                        <p>Мастер Шеф</p>\n                    </a>\n\n                    <a class=\"photo\" href=\"\">\n                        <img src=\"assets/tpl/images/photos-6.png\" alt=\"Мастер Шеф\">\n                        <p>Мастер Шеф</p>\n                    </a>\n\n                    <a class=\"photo\" href=\"\">\n                        <img src=\"assets/tpl/images/photos-4.png\" alt=\"Мастер Шеф\">\n                        <p>Мастер Шеф</p>\n                    </a>\n\n                    <a class=\"photo\" href=\"\">\n                        <img src=\"assets/tpl/images/photos-2.png\" alt=\"Мастер Шеф\">\n                        <p>Мастер Шеф</p>\n                    </a>\n\n                    <a class=\"photo\" href=\"\">\n                        <img src=\"assets/tpl/images/photos-3.png\" alt=\"Мастер Шеф\">\n                        <p>Мастер Шеф</p>\n                    </a>\n\n                    <a class=\"photo\" href=\"\">\n                        <img src=\"assets/tpl/images/photos-6.png\" alt=\"Мастер Шеф\">\n                        <p>Мастер Шеф</p>\n                    </a>\n                </div>\n				-->\n\n                <div class=\"row clearFix\" style=\"overflow: hidden\">\n					[!Ditto? &tpl=`citate.item` &parents=`322` &display=`1` &randomize=`1` &sortBy=`menuindex` &sortDir=`ASC` &noResults=``!]\n                    \n\n                    <div class=\"response\">\n                        <img src=\"assets/tpl/images/response-1.png\" alt=\"\" class=\"circleImg\" data-ccolor=\"#ffce54\">\n                        <h5>Клуни Джордж, Нью йорк</h5>\n                        <p>Мне всегда не нравилось,как работает наш оператор.Лучшее, что я мог сделать - стать оператором сам!<br>Подготовка в видеошколе ОПРСТ - лучше, чем в Голливуде!</p>\n                    </div>\n\n                    <div class=\"response\">\n                        <img src=\"assets/tpl/images/response-2.png\" alt=\"\" class=\"circleImg\" data-ccolor=\"#ff7e7e\">\n                        <h5>Питт Бред, Нью йорк</h5>\n                        <p>Мы любим снимать семейные торжества. Теперь в нашей коллекции только профессиональные видео.<br>Спасибо школе ОПРСТ, что научила! </p>\n                    </div>\n                </div>\n\n                <div class=\"row inputForm\">\n                    <button class=\"bouttonYellow\" id=\"openButton\">Отправить заявку на обучение</button>\n\n                    <form id=\"slideForm\" action=\"https://docs.google.com/forms/d/19P3plCrE8bScoOba2HXcoaYNeG1y8LC8BLI3rnOJkHQ/formResponse\" method=\"POST\" id=\"ss-form\">\n                        <div>\n                            <h3>Записаться на обучение</h3>\n\n                            <div class=\"rowForm\">\n                                <span class=\"inputLabel\">ФИО<span class=\"redStar\">*</span></span>\n                                <input type=\"text\" placeholder=\"Полностью как в паспорте\" name=\"entry.1032636593\" value=\"\" class=\"ss-q-short\" aria-label=\"ФИО Полностью как на паспорте \" aria-required=\"true\" required=\"\" title=\"\">\n                                \n                                <span class=\"inputLabel\">Пол<span class=\"redStar\">*</span></span>\n\n                                <div class=\"rowBuild clearfix\">\n                                    <label>\n                                        <input type=\"radio\" name=\"entry.1459217013\" value=\"Мужской\"  role=\"radio\" class=\"ss-q-radio\" aria-label=\"Мужской\" required=\"\" aria-required=\"true\">\n                                        <span class=\"ss-choice-label\">м</span>\n                                    </label>\n                                    \n                                    <label>\n                                        <input type=\"radio\" name=\"entry.1459217013\" value=\"Женский\" id=\"group_1459217013_2\" role=\"radio\" class=\"ss-q-radio\" aria-label=\"Женский\" required=\"\" aria-required=\"true\">\n                                        <span class=\"ss-choice-label\">ж</span>\n                                    </label>\n                                </div>\n                                    \n                                <span class=\"inputLabel\">Дата рождения<span class=\"redStar\">*</span></span>        \n                                <input type=\"date\" name=\"entry.663414528\" value=\"\" class=\"ss-q-date required\" dir=\"auto\" id=\"entry_663414528\" aria-label=\"Дата рождения Указать дату рождения заполнителя \" aria-required=\"true\" required=\"\">\n\n                                <span class=\"inputLabel\">Номер телефона<span class=\"redStar\">*</span></span>\n                                <input type=\"text\" name=\"entry.1692470219\" required=\"\">\n\n                                <span class=\"inputLabel\">Электронная почта<span class=\"redStar\">*</span></span>\n                                <input type=\"email\" name=\"entry.379713674\" required=\"\">\n\n                                <span class=\"inputLabel\">Психологический возраст<span class=\"redStar\">*</span></span>\n                                <input type=\"number\" name=\"entry.1773368349\" required=\"\" class=\"miniField\">\n                            </div>\n\n                            <div class=\"rowForm\" style=\"margin-left: 0px\">\n                                <span class=\"inputLabel\">Имеющийся опыт</span>\n                                \n                                <label>\n                                    <input type=\"checkbox\" name=\"entry.1209758365\" value=\"Работа в кадре (Ведущий)\" id=\"group_1209758365_1\" role=\"checkbox\" class=\"ss-q-checkbox\" aria-required=\"true\">\n                                    <span class=\"ss-choice-label\">Работа в кадре (Ведущий)</span>\n                                </label>\n\n                                <label>\n                                    <input type=\"checkbox\" name=\"entry.1209758365\" value=\"Видеосъёмка\" id=\"group_1209758365_2\" role=\"checkbox\" class=\"ss-q-checkbox\" aria-required=\"true\">\n                                    <span class=\"ss-choice-label\">Видеосъёмка</span>\n                                </label>\n\n                                <label>\n                                    <input type=\"checkbox\" name=\"entry.1209758365\" value=\"Фотосъёмка\" id=\"group_1209758365_3\" role=\"checkbox\" class=\"ss-q-checkbox\" aria-required=\"true\">\n                                    <span class=\"ss-choice-label\">Фотосъёмка</span>\n                                </label>\n\n                                <label>\n                                    <input type=\"checkbox\" name=\"entry.1209758365\" value=\"Видеомонтаж\" id=\"group_1209758365_4\" role=\"checkbox\" class=\"ss-q-checkbox\" aria-required=\"true\">\n                                    <span class=\"ss-choice-label\">Видеомонтаж</span>\n                                </label>\n\n                                <label>\n                                    <input type=\"checkbox\" name=\"entry.1209758365\" value=\"Фотомонтаж\" id=\"group_1209758365_5\" role=\"checkbox\" class=\"ss-q-checkbox\" aria-required=\"true\">\n                                    <span class=\"ss-choice-label\">Фотомонтаж</span>\n                                </label>\n\n                                <label>\n                                    <input type=\"checkbox\" name=\"entry.1209758365\" value=\"Не имею опыта\" id=\"group_1209758365_6\" role=\"checkbox\" class=\"ss-q-checkbox\" aria-required=\"true\">\n                                    <span class=\"ss-choice-label\">Не имею опыта</span>\n                                </label>\n\n                                <div class=\"textArea\" style=\"margin-top: 16px;\">\n                                    <label class=\"ss-q-item-label\" for=\"entry_211068525\">\n                                        <div class=\"ss-q-title\">Род деятельности</div>\n                                    </label>\n\n                                    <textarea name=\"entry.211068525\" rows=\"8\" cols=\"0\" class=\"ss-q-long\" id=\"entry_211068525\" dir=\"auto\" placeholder=\"Место работы или учёбы\" aria-required=\"true\" required=\"\"></textarea>\n                                </div>\n\n                                <div class=\"textArea\" style=\"margin-top: 16px;\">\n                                    <label class=\"ss-q-item-label\" for=\"entry_897906518\">\n                                        <div class=\"ss-q-title\">Хобби</div>\n                                    </label>\n\n                                    <textarea name=\"entry.897906518\" style=\"height: 60px\"></textarea>\n                                </div>\n\n                                <div class=\"ss-form-entry\" style=\"margin-top: 18px\">\n                                    <label class=\"ss-q-item-label\" for=\"entry_388386528\">\n                                        <div class=\"ss-q-title\">Хоббит<span class=\"redStar\">*</span></div>\n                                        <div class=\"ss-q-help ss-secondary-text\" dir=\"ltr\">Мы не имеем ничего против жителей Средиземья, но нам это важно знать!</div>\n                                    </label>\n\n                                    <select name=\"entry.388386528\" class=\"miniField\" aria-label=\"Хоббит Мы не имеем ничего против жителей Средиземья, но нам это важно знать! \" aria-required=\"true\" required=\"\">\n                                        <option value=\"Да\">Да</option>\n                                        <option value=\"Нет\">Нет</option>\n                                    </select>\n                                </div>\n                            </div>\n\n                            <div class=\"rowForm\" style=\"margin-bottom: 0px\">\n                                <label class=\"textArea2\">\n                                    <span class=\"inputLabel\">Что вы думаете о хоббитах?</span>\n\n                                    <div class=\"ss-q-help ss-secondary-text\" dir=\"ltr\">Среди преподавательского состава присутствует несколько хоббитов, поэтому крайне важно знать Ваше отношение к ним.</div>\n\n                                    <textarea name=\"entry.266845174\" class=\"textArea2\"  aria-label=\"Что вы думаете о хоббитах? Среди преподавательского состава присутствует несколько хоббитов, поэтому крайне важно знать Ваше отношение к ним. \" aria-required=\"true\"></textarea>\n                                </label>\n\n                                <label class=\"textArea2\">\n                                    <span class=\"inputLabel\">Чего вы ждёте от курса обучения? <span class=\"redStar\">*</span></span>\n\n                                    <div class=\"ss-q-help ss-secondary-text\" dir=\"ltr\">Какова цель вашего стремления учится в школе ОПРСТ?</div>\n\n                                    <textarea name=\"entry.1997637239\" rows=\"8\" cols=\"0\"  dir=\"auto\" aria-label=\"Чего вы ждёте от курса обучения? Какова цель вашего стремления учится в школе ОПРСТ? \" aria-required=\"true\" required=\"\"></textarea>\n                                </label>\n\n                                <label class=\"textArea2\">\n                                    <span class=\"inputLabel\">Напишите короткое эссе О СЕБЕ? <span class=\"redStar\">*</span></span>\n\n                                    <div class=\"ss-q-help ss-secondary-text\" dir=\"ltr\">эссе необходимо ОБЯЗАТЕЛЬНО использовать следующие слова: Я, друзья, самое лучшее, труба, уверен, учеба, диван, ведро, мечта, уважение, хочу, хорошо.</div>\n\n                                    <textarea name=\"entry.12861237\"  aria-label=\"Чего вы ждёте от курса обучения? Какова цель вашего стремления учится в школе ОПРСТ? \" aria-required=\"true\" required=\"\"></textarea>\n                                </label>\n\n                                <label class=\"textArea2\">\n                                    <span class=\"inputLabel\">Хотите скидку? Напишите почему Вы её достойны!<span class=\"redStar\">*</span></span>\n\n                                    <textarea name=\"entry.1612069060\" rows=\"8\" cols=\"0\"  dir=\"auto\" aria-label=\"Чего вы ждёте от курса обучения? Какова цель вашего стремления учится в школе ОПРСТ? \" aria-required=\"true\" required=\"\"></textarea>\n                                </label>\n\n                                <div id=\"breakList\" class=\"clearFlex\">\n                                    <label>\n                                        <input type=\"checkbox\" name=\"entry.702092584\" value=\"Реклама на сайте ОПРСТ\" role=\"checkbox\" aria-required=\"true\">\n                                        <span class=\"ss-choice-label\">Реклама на сайте ОПРСТ</span>\n                                    </label>\n\n                                    <label>\n                                        <input type=\"checkbox\" name=\"entry.702092584\" value=\"Совет друга\" role=\"checkbox\" aria-required=\"true\">\n                                        <span class=\"ss-choice-label\">Совет друга</span>\n                                    </label>\n\n                                    <label>\n                                        <input type=\"checkbox\" name=\"entry.702092584\" value=\"Реклама на улице\" role=\"checkbox\" aria-required=\"true\">\n                                        <span class=\"ss-choice-label\">Реклама на улице</span>\n                                    </label>\n\n                                    <label>\n                                        <input type=\"checkbox\" name=\"entry.702092584\" value=\"Явление во сне\" role=\"checkbox\" aria-required=\"true\">\n                                        <span class=\"ss-choice-label\">Явление во сне</span>\n                                    </label>\n\n                                    <label>\n                                        <span class=\"ss-choice-label\">Другое:</span>\n\n                                        <input type=\"text\" name=\"entry.702092584.other_option_response\" value=\"\" class=\"ss-q-other\" dir=\"auto\" aria-label=\"Другое\">\n                                    </label>\n                                </div>\n                            </div>\n                        </div>\n                        \n                        <input type=\"submit\" name=\"submit\" id=\"ss-submit\" class=\"bouttonYellow\" style=\"margin: 12px auto -30px;\" value=\"Отправить\">\n                    </form>\n                </div>\n\n                <div class=\"row\">\n\n                    <div class=\"partners\">\n                        <h3>Наши постоянные партнёры</h3>\n                        <div>\n							<a href=\"/our_project.html\"><img src=\"assets/images/partner_step.png\" height=\"60\" width=\"62\" alt=\"КА ШАГ\"></a>\n							<a href=\"/our_project.html\"><img src=\"assets/images/partner_videoschool.png\" height=\"44\" width=\"125\" alt=\"Video School\" style=\"margin-bottom: 7px; margin-left: 35px\"></a>\n							<a href=\"/our_project.html\"><img src=\"assets/images/partner_0629.jpg\" height=\"60\" width=\"62\" alt=\"Video School\" style=\"margin-bottom: 7px; margin-left: 35px\"></a>\n							<a href=\"/our_project.html\"><img src=\"assets/images/partner_mtv.jpg\" height=\"60\" width=\"62\" alt=\"Video School\" style=\"margin-bottom: 7px; margin-left: 35px\"></a>\n							<a href=\"/our_project.html\"><img src=\"assets/images/partner_met.jpg\" height=\"60\" width=\"62\" alt=\"Video School\" style=\"margin-bottom: 7px; margin-left: 35px\"></a>\n							<a href=\"/our_project.html\"><img src=\"assets/images/partner_port.jpg\" height=\"60\" width=\"62\" alt=\"Video School\" style=\"margin-bottom: 7px; margin-left: 35px\"></a>\n							<a href=\"/our_project.html\"><img src=\"assets/images/partner_stb.jpg\" height=\"60\" width=\"62\" alt=\"Video School\" style=\"margin-bottom: 7px; margin-left: 35px\"></a>\n							<a href=\"/our_project.html\"><img src=\"assets/images/partner_trinity.jpg\" height=\"60\" width=\"62\" alt=\"Video School\" style=\"margin-bottom: 7px; margin-left: 35px\"></a>\n                        </div>\n                    </div>\n                </div>\n            </div>\n{{inc_footer}}','0');
INSERT INTO `oprst_site_templates` VALUES ('28','Рабство','','0','0','','0','{{inc_meta}}\n{{inc_header}}\n<div class=\"center content home\" style=\"margin-top: 4px;\">\n            	<div class=\"bigtitle\" style=\"margin-left: -60px;\"><span>Возьмите</span></div>\n            	<div class=\"bigtitle\" style=\"margin-top: -70px; margin-left: 128px;\"><span>в рабство</span></div>\n\n	<div class=\"article_video\">\n            		<p>\n                		Если ты хочешь работать в самом чумачечем коллективе , если в дурдоме тебя считают слишком ненормальным, а бабушки у подъезда не знают к какой категории тебя отнести, тогда дорога тебе в ОПРСТ.\n	                </p>\n\n	                <p>\n	                    Нам грустненько и одиноко без:\n	                </p>\n            	</div>\n\n            	<div id=\"rabstvo\">\n            		<ul  class=\"clearfix\">\n            			<li>\n            				<h3>Видеооператоры</h3>\n            				<span>(с накачанной левой рукой)</span>\n            			</li>\n            			<li>\n            				<h3>Ведущие</h3>\n            				<span>(только красивые)</span>\n            			</li>\n            			<li>\n            				<h3>Видеомонтажеры</h3>\n            				<span>(с креативными усами, приветствуются девушки)</span>\n            			</li>\n            			<li style=\"margin-left: 5px\">\n            				<h3>PR-щики</h3>\n            				<span>(с длинным языком)</span>\n            			</li>\n            			<li style=\"margin-left: 15px\">\n            				<h3>Продавцы IT-услуг</h3>\n            				<span>(приставучие и убедительные)</span>\n            			</li>\n            			<li>\n            				<h3>Специалисты постобработки, 3D графики и спецэффектов</h3>\n            				<span>(с желтыми штанами)</span>\n            			</li>\n            			<li>\n            				<h3>Дикторы</h3>\n            				<span>(выговаривающие буквы: О, П, Р, С, Т, Ж, Г, ۻ)</span>\n            			</li>\n            		</ul>\n            	</div>\n\n            	<div class=\"article_video\">\n            		<p>\n            			<em>Присылайте свои резюме на e-mail <a href=\"mailto:oprst.hr@gmail.com\">oprst.hr@gmail.com</a> с темой письма \"Работа\"</em>\n	                </p>\n\n	                <p>\n	                    <ul class=\"treb\">\n	                    	<li><b><em>Резюме должно содержать:</em></b></li>\n	                    	<li><em>желаемая должность</em></li>\n	                    	<li><em>город проживания</em></li>\n	                    	<li><em>опыт работы</em></li>\n	                    	<li><em>навыки и квалификация</em></li>\n	                    	<li><em>дата рождения</em></li>\n	                    </ul>\n	                </p>\n\n	<a href=\"mailto:oprst.hr@gmail.com\" class=\"bouttonYellow\" id=\"openButton\">Отправить резюме</a>\n            	</div>\n            </div>\n{{inc_footer}}','0');
